(4040, 45, 19146, 1, 2, 'Legal Services', '<p>You are at the beginning of the Legal Services branch of questions.  Within this branch, you will be asked to allocate the <strong>[ANSWER VALUE]</strong> hours you devote annually to providing legal advice and related services irrespective of whether those services are chargeable to clients.</p>\r\n<p>The survey will guide you through a tiered structure of questions where you will be asked to allocate your time by assigning percentages to various activities.  Because the survey is progressive, each level represents a greater level of detail.  Accordingly, at each level of the survey, you are asked to allocate 100% of the time you spend within that category only.</p>\r\n', 3533),
(4041, 45, 19145, 1, 2, 'Support Activities', '<p>You are at the beginning of the Support Activities branch of questions.  Within this branch, you will be asked to allocate the <strong>[ANSWER VALUE]</strong> hours you devote annually to providing support services irrespective of whether or not they are chargeable to a client.</p>\r\n<p>The survey will guide you through a tiered structure of questions where you will be asked to allocate your time by assigning percentages to various activities.  Because the survey is progressive, each level represents a greater level of detail.  Accordingly, at each level of the survey, you are asked to allocate 100% of the time you spend within that category only.</p>', 3534),
