(19180, 45, 3945, 'Written Discovery /Interrogatories', '', 'Developing, responding, or objecting to interrogatories or request to admit and summarizing interrogatories and admissions received.', '', '10', 'L310', 1, 1, 17400),
(19181, 45, 3946, 'Enforcement', '', 'Enforcing judgments, collecting judgments, and filings for stay pending appeal.', '', '40', 'L470', 7, 1, 17412),
(19182, 45, 3946, 'Post-Trial Motions/Submissions', '', 'Developing, responding, or arguing post-verdict matters, researching post-trial motions and submissions, and related travel.', '', '35', 'L460', 6, 1, 17411),
(19183, 45, 3946, 'Trial Preparation and Support', '', 'Preparing for trial. It includes preparing opening and closing arguments, establishing off-site support office, identifying documents and evidence for use at trial, preparing demonstrative materials and exhibits, indexing and summarizing deposition abstracts, conducting mock trials and focus groups, jury research, and travel to/from trial preparation.', '', '25', 'L440', 4, 1, 17409),
(19155, 45, 3942, 'Case Assessment, Development and Administration', '', 'Understanding the facts of matter, developing strategy, working with experts or consultants, organizing file materials, managing budgets, and participating in settlement activities.', '', '10', 'L100', 1, 1, 17386),
(19157, 45, 3942, 'Discovery', '', 'A category of procedural devices employed by a party to a civil or criminal action, prior to trial, to require the adverse party to disclose information that is essential for the preparation of the requesting partyâ€™s case and that the other party alone knows or possesses.', '', '20', 'L300', 3, 1, 17383),
(19156, 45, 3942, 'Pre-Trial Pleadings and Motions', '', 'All pleadings and pretrial motions and procedures other than discovery.', '', '15', 'L200', 2, 1, 17385),
(19154, 45, 3941, 'Trademark', 'Trademark Support', 'The assessment, development and administration of trademarks. Includes trademark investigation and analysis, domestic and international trademark application preparation, domestic and international trademark prosecution and renewal, and related activities.', 'The support of representations related to the assessment, development and administration of trademarks. Includes trademark investigation and analysis, domestic and international trademark application preparation, domestic and international trademark prosecution and renewal, and related activities.', 'TM', '', 4, 1, 17372),
(19153, 45, 3941, 'Patent', 'Patent Support', 'The assessment, development and administration of patents. Includes patent investigation and analysis, domestic and international patent preparation, domestic and international patent prosecution, and related activities.', 'Support of the assessment, development and administration of patents. Includes patent investigation and analysis, domestic and international patent preparation, domestic and international patent prosecution, and related activities.', 'PT', '', 3, 1, 17373),
(19152, 45, 3941, 'Transactional', 'Project (Transaction/M&#38;A) Support', 'Deals or transactions (e.g., real estate, securities, financings, restructurings, mergers and acquisitions), administrative filings with federal and state agencies, and stand-alone projects (e.g., establishing an environmental compliance program).', 'The support of deals or transactions (e.g., real estate, securities, financings, restructurings, mergers and acquisitions), administrative filings with federal and state agencies, and stand-alone projects (e.g., establishing an environmental compliance program).', 'PR', '', 2, 1, 17374),
(19151, 45, 3941, 'Workersâ€™ Compensation', 'Workersâ€™ Compensation Support', 'State-sponsored systems that pays monetary benefits to workers who become injured or disabled in the course of their employment.', 'The support of Workers&#39; Compensation matters.', 'WC', '', 5, 1, 17375),
(19306, 45, 3966, 'Domain Names - ccTLDs', '', 'Completing a domain name application (including renewal) that is to be filed as a country code top-level domain (ccTLD), e.g., .jp, .uk, .tv.', '', '35', 'TR760', 6, 1, 17559),
(19307, 45, 3966, 'Assignments and Security Interests', '', 'Negotiating and preparing assignment (i.e. previously registered or filed application) or security interest, including review of file history, checking status and meeting with client.', '', '20', 'TR730', 3, 1, 17556),
(19308, 45, 3966, 'Licensing', '', 'Negotiating and preparing trademark license.', '', '25', 'TR740', 4, 1, 17557),
(19309, 45, 3966, 'Domain Names - gTLDs', '', 'Completing a domain name application (including renewal) that is to be filed as a generic top-level domain (gTLD), e.g., .com.', '', '30', 'TR750', 5, 1, 17558),
(19310, 45, 3966, 'Portfolio Analysis and Management', '', 'Reviewing, analyzing, documenting, and managing a portfolio of trademarks. Includes trademark \"due diligence\" during transactional analysis.', '', '15', 'TR720', 2, 1, 17555),
(19311, 45, 3966, 'Opinion Preparation', '', 'Completing formal legal opinions on the validity, enforceability, infringement, and/or non-infringement of a trademark right. It includes opinions on infringement of a client&rsquo;s trademark by a non-client infringer.', '', '10', 'TR710', 1, 1, 17554),
(19312, 45, 3967, 'Appellate Practice', '', 'Appellate proceedings/motions; appellate briefs, oral arguments/post submission, and associated alternative fee agreements (AFA&rsquo;s).', '', '30', 'WC500', 5, 1, 17566),
(19313, 45, 3967, 'Hearings/Trial Practice', '', 'The examination of fact and expert witnesses, written motions/submissions, Hearing preparation and support, hearing appearances, post-hearing activities, subrogation claims, and associated alternative fee arrangements (AFA&rsquo;s).', '', '25', 'WC400', 4, 1, 17565),
(19314, 45, 3967, 'Discovery/Document Production', '', 'Written discovery, document production and acquisition, depositions, expert discovery, discovery motions, discovery on-site inspections and visits, and associated alternative fee arrangements (AFA&rsquo;s).', '', '20', 'WC300', 3, 1, 17564),
(19315, 45, 3967, 'Pleadings/Preliminary Proceedings', '', 'Developing and preparing pleadings, meetings and conferences with judge up to Hearing, and associated alternative fee arrangements (AFA&rsquo;s).', '', '15', 'WC200', 2, 1, 17563),
(19316, 45, 3967, 'Initial Assessment', '', 'The initial assessment of case and/or issue and outcomes. Includes fact investigation, analysis, strategy development, identifying experts, budgeting, and settlement/mediation activities and associated alternative fee arrangements (AFA&rsquo;s).', '', '10', 'WC100', 1, 1, 17562),
(19317, 45, 3968, 'Budgeting', '', 'The preparation of budget and related communications.', '', '25', 'WC150', 4, 1, 17570),
(19318, 45, 3968, 'Settlement/Resolution', '', 'The planning and participation in settlement or mediation discussions. It includes conferences and communications with attorney, adjuster and employer and/or other party.', '', '30', 'WC160', 5, 1, 17571),
(19319, 45, 3968, 'Alternative Fee Arrangements (AFA&rsquo;s)', '', 'The development, calculation or approval of all non-hourly or other alternative fee arrangements for tasks and activities in this category.', '', '35', 'WC180', 6, 1, 17572),
(19320, 45, 3968, 'Fact Investigation/Development', '', 'Investigating and/or understanding the facts of a matter.', '', '10', 'WC110', 1, 1, 17567),
(19321, 45, 3968, 'Analysis/Strategy', '', 'Thinking, strategizing, and planning for a case.', '', '15', 'WC120', 2, 1, 17568),
(19322, 45, 3968, 'Experts/Consultants', '', 'Selecting experts, reviewing reports, and communication regarding opinions.', '', '20', 'WC130', 3, 1, 17569),
(19323, 45, 3969, 'Alternative Fee Arrangements (AFA&rsquo;s)', '', 'The development, calculation or approval of all non-hourly or other alternative fee arrangements for tasks and activities in this category.', '', '20', 'WC280', 3, 1, 17575),
(19324, 45, 3969, 'Conferences with Judge', '', 'Preparing for, attending, and reporting on conference with judge. It includes all matters up to hearing on merits. Actual hearing/trial matters are excluded.', '', '15', 'WC230', 2, 1, 17574),
(19325, 45, 3969, 'Pleadings', '', 'Drafting, editing and filing pleadings, Workers&rsquo; Comp State forms, pre-hearing notices, and affidavits. It includes related research and review of opposing counsel pleadings.', '', '10', 'WC210', 1, 1, 17573),
(19326, 45, 3970, 'Alternative Fee Arrangements (AFA&rsquo;s)', '', 'Development, calculation or approval of all non-hourly or other alternative fee arrangements for tasks and activities in this category.', '', '40', 'WC380', 7, 1, 17582),
(19327, 45, 3970, 'Expert Discovery', '', 'Preparing notices, communication with experts and opposing counsel, preparing subpoenas, strategy discussions, document review, preparing summaries, scheduling and reviewing IME&rsquo;s and IRE&rsquo;s.', '', '25', 'WC340', 4, 1, 17579),
(19328, 45, 3970, 'Discovery On-Site Inspections/Visits', '', 'Attending, traveling to/from, and summarizing results from site inspection/visits.', '', '35', 'WC360', 6, 1, 17581),
(19329, 45, 3970, 'Discovery Motions', '', 'Preparing, responding to, and arguing all motions that arise out of discovery. Includes protective orders.', '', '30', 'WC350', 5, 1, 17580),
(19330, 45, 3970, 'Depositions', '', 'Preparing notices, communication and preparation of witnesses, discussing strategy, deposition preparation, attending, and travel to/from depositions.', '', '20', 'WC330', 3, 1, 17578),
(19331, 45, 3970, 'Written Discovery', '', 'Preparing, identifying, summarizing, and analyzing written discovery. It includes reviewing responses to written discovery and attending mandatory meet-and-confer sessions.', '', '10', 'WC310', 1, 1, 17576),
(19332, 45, 3970, 'Document Production/Acquisition', '', 'Preparing and responding and/or objecting to document request. It includes identifying and reviewing documents for production and privilege, and preparation of subpoenas and requests.', '', '15', 'WC320', 2, 1, 17577),
(19333, 45, 3971, 'Alternative Fee Arrangements (AFA&rsquo;s)', '', 'The development, calculation or approval of all non-hourly or other alternative fee arrangements for tasks and activities in this category.', '', '45', 'WC480', 8, 1, 17590),
(19334, 45, 3971, 'Subrogation Claims', '', 'Assertion of subrogation claims on behalf of employer or carrier.', '', '40', 'WC470', 7, 1, 17589),
(19335, 45, 3971, 'Post-Hearing', '', 'Preparing proposed findings of fact, conclusions of law, position paper, and memorandum of law in support thereof, preparing and preserving objections, post hearing conferences, and preparing and reviewing order for court.', '', '35', 'WC460', 6, 1, 17588),
(19336, 45, 3971, 'Hearing Preparation and Support', '', 'Identifying documents and evidence, preparing evidence/exhibits, pre-hearing conferences, prepatory research, deposition review, and preparation of memorandum of law and opening/closing statements.', '', '25', 'WC440', 4, 1, 17586),
(19337, 45, 3971, 'Hearing', '', 'Appearances, arguing motions, travel to/from hearings, and post-hearing communication/report regarding hearing.', '', '30', 'WC450', 5, 1, 17587),
(19338, 45, 3971, 'Expert Witnesses', '', 'Preparing for examination and cross-examination of expert witnesses, expert witness interviews, and review and analysis of transcripts.', '', '15', 'WC420', 2, 1, 17584),
(19339, 45, 3971, 'Written Motions/Submissions', '', 'Developing, reviewing, and responding to written motions. Includes activities related to motions for hearing as well as jurisdictional and dispositive motions.', '', '20', 'WC430', 3, 1, 17585),
(19340, 45, 3971, 'Fact Witnesses', '', 'Preparing for examination and cross-examination of witnesses, witness interviews, and review and analysis of transcripts.', '', '10', 'WC410', 1, 1, 17583),
(19341, 45, 3972, 'Appellate Briefs', '', 'The preparation and review of appellate briefs, related research, preparing and reviewing appellate record, and communication with parties.', '', '15', 'WC520', 2, 1, 17592),
(19342, 45, 3972, 'Oral Arguments/Post Submission', '', 'Preparing for, attending, and traveling to/from oral arguments, communication regarding appeal, and review of decision.', '', '20', 'WC530', 3, 1, 17593),
(19343, 45, 3972, 'Alternative Fee Arrangements (AFA&rsquo;s)', '', 'The development, calculation or approval of all non-hourly or other alternative fee arrangements for tasks and activities in this category.', '', '25', 'WC580', 4, 1, 17594),
(19344, 45, 3972, 'Appellate Proceedings/Motions', '', 'Researching, drafting and arguing motions or other filings, attending and traveling to/from hearings, and review and preparation of notice of appeal and appellate petition.', '', '10', 'WC510', 1, 1, 17591),
(19345, 45, 3973, 'Business Operations', '', 'Business operations, employee benefits/pensions, financing/cash collections, tax issues, real estate, and Board of Directors matters.', '', '15', 'B200', 2, 1, 17596),
(19346, 45, 3973, 'Claims Administration and Plan Disclosure', '', 'Claims administration and objections and Plan Disclosure Statement.', '', '20', 'B300', 3, 1, 17597),
(19347, 45, 3973, 'Related Advice', '', 'The support of general bankruptcy advice/options; restructuring.', '', '25', 'B400', 4, 1, 17598),
(19348, 45, 3973, 'Administration', '', 'Case administration, asset analysis or recovery, asset disposition, relief from Stay/Adequate proceedings, meetings and communications with creditors, fee/employment applications and objections, avoidance action analysis, assumption/rejection of leases and contracts, and other contested matters.', '', '10', 'B100', 1, 1, 17595),
(19349, 45, 3974, 'Non-Working Travel', '', 'Non-working travel.', '', '60', 'B195', 11, 1, 17609),
(19350, 45, 3974, 'Assumption or Rejection of Leases and Contracts', '', 'The analysis of leases and executory contracts or preparation of motions specifically to assume or reject.', '', '50', 'B185', 9, 1, 17607),
(19351, 45, 3974, 'Other Contested Matters', '', 'The analysis or preparation of all other motions, opposition to motions or reply memoranda in support of motions (excludes assumption or rejection motions).', '', '55', 'B190', 10, 1, 17608),
(19352, 45, 3974, 'Meetings of and Communication with Creditors', '', 'Preparing for and attending the conference of creditors, the 341(a) meeting or other creditors&rsquo; committee meetings.', '', '30', 'B150', 5, 1, 17603),
(19353, 45, 3974, 'Fee or Employment Objections', '', 'The review of or objections to the employment or fee applications of others.', '', '40', 'B170', 7, 1, 17605),
(19354, 45, 3974, 'Avoidance Action Analysis', '', 'The review of potential avoiding actions under Sections 544-549 of the Code to determine whether adversary proceedings are warranted.', '', '45', 'B180', 8, 1, 17606),
(19355, 45, 3974, 'Fee/Employment Applications', '', 'Preparing employment and fee applications, motions to establish interim procedures.', '', '35', 'B160', 6, 1, 17604),
(19356, 45, 3974, 'Relief from Stay or Adequate Protection Proceedings', '', 'The termination or continuation of automatic stay under 362 or motions for adequate protection.', '', '25', 'B140', 4, 1, 17602),
(19357, 45, 3974, 'Asset Analysis and Recovery', '', 'The identification and review of potential assets including causes of action and non-litigation recoveries.', '', '15', 'B120', 2, 1, 17600),
(19358, 45, 3974, 'Asset Disposition', '', 'Sales, abandonment or transaction work related to asset disposition.', '', '20', 'B130', 3, 1, 17601),
(19359, 45, 3974, 'Case Administration', '', 'Coordination and compliance activities, including preparation of statement of financial affairs, schedules, list of contracts, United States Trustee interim statements and operating reports, contacts with the United States Trustee, and general creditor inquiries.', '', '10', 'B110', 1, 1, 17599),
(19360, 45, 3975, 'Board of Directors Matters', '', 'The preparation of materials for or attendance at Board of Directors meetings, analysis or advice regarding corporate governance issues, and review or preparation of corporate documents.', '', '35', 'B260', 6, 1, 17615),
(19361, 45, 3975, 'Financing and Cash Collections', '', 'Matters under 361, 363 and 364 including cash collateral and secured claims and loan document analysis.', '', '20', 'B230', 3, 1, 17612),
(19362, 45, 3975, 'Tax Issues', '', 'The analysis or advice regarding tax-related issues.', '', '25', 'B240', 4, 1, 17613),
(19363, 45, 3975, 'Real Estate', '', 'The review or analysis of real estate-related matters.', '', '30', 'B250', 5, 1, 17614),
(19364, 45, 3975, 'Employee Benefits and Pensions', '', 'The review of issues such as severance, retention, 401(k) coverage or continuance of pension plan.', '', '15', 'B220', 2, 1, 17611),
(19365, 45, 3975, 'Operations', '', 'Issues related to a debtor-in-possession operating in chapter 11 such as employee, vendor, tenant issues or similar problems.', '', '10', 'B210', 1, 1, 17610),
(19366, 45, 3976, 'Claims Administration or Objections', '', 'Specific claim inquiries, bar date motions, analyses, and objections or allowances of claims.', '', '10', 'B310', 1, 1, 17616),
(19367, 45, 3976, 'Plan Disclosure Statement (Incl. Business Plan)', '', 'Formulation, presentation or confirmation, compliance with the plan confirmation order, related orders or rules, and disbursement or case closing activities.', '', '15', 'B320', 2, 1, 17617),
(19368, 45, 3977, 'Restructuring', '', 'Analysis, consultation or drafting in connection with the restructuring of agreements where no bankruptcy case has been filed.', '', '15', 'B420', 2, 1, 17619),
(19369, 45, 3977, 'General Bankruptcy Advice/Opinions', '', 'The support of analysis, advice or opinions regarding potential bankruptcy related issues where no bankruptcy case has been filed.', '', '10', 'B410', 1, 1, 17618),
(19370, 45, 3978, 'Research Law', '', 'Legal research tasks, including internal meetings and consultations with those with special expertise.', '', '15', 'C200', 2, 1, 17621),
(19371, 45, 3978, 'Analysis and Advice', '', 'Supporting the analysis of facts or research performed and communicating related opinions or advice to clients.', '', '20', 'C300', 3, 1, 17622),
(19372, 45, 3978, 'Third Party Communications', '', 'Supporting communications with third parties not otherwise covered in this Substantive Area. Includes communications with regulators or parties to contracts with the client.', '', '25', 'C400', 4, 1, 17623),
(19373, 45, 3978, 'Fact Gathering', '', 'Supporting initial inquiries, meetings and instructions. Includes the identification and collection of information relevant to the assignment.', '', '10', 'C100', 1, 1, 17620),
(19374, 45, 3979, 'Informational Meetings', '', 'Supporting initial inquiries or meetings.', '', '10', 'C110', 1, 1, 17624),
(19375, 45, 3979, 'Information Review', '', 'Supporting the identification or collection of information relevant to the assignment.', '', '15', 'C120', 2, 1, 17625),
(19376, 45, 3980, 'Consultations', '', 'Internal meetings or consultations with those with special expertise.', '', '10', 'C210', 1, 1, 17628),
(19377, 45, 3980, 'On-Line Research', '', 'Computer or on-line research in support of assignment.', '', '15', 'C220', 2, 1, 17626),
(19378, 45, 3980, 'Other Legal Research', '', 'Other legal research performed in support of assignment.', '', '20', 'C230', 3, 1, 17627),
(19379, 45, 3981, 'Analysis', '', 'Supporting the analysis of facts or research performed.', '', '10', 'C310', 1, 1, 17629),
(19380, 45, 3981, 'Advice', '', 'Supporting the communication of related opinions or advice to clients.', '', '15', 'C320', 2, 1, 17630),
(19381, 45, 3982, 'Contract Party Communications', '', 'Supporting communications with parties to contracts with the client.', '', '10', 'C410', 1, 1, 17633),
(19382, 45, 3982, 'Regulatory Communications', '', 'Supporting communications with regulators and regulatory agencies.', '', '15', 'C420', 2, 1, 17631),
(19383, 45, 3982, 'Other Communications', '', 'Supporting communications with other third parties.', '', '20', 'C430', 3, 1, 17632),
(19384, 45, 3983, 'Tactical Initiatives', '', 'Processes associated with a variety of enterprise level tactical initiatives.  It includes processes implemented to manage information at an enterprise level; identify, avoid and manage risk; and organize and manage knowledge and expertise.', '', 'TI', '', 6, 1, 17638),
(19385, 45, 3983, 'Administrative Support', '', 'Processes associated with general office operations. Includes document services (production, reproduction and management), court services (docket), phone and fax services, meeting coordination, travel, facilities management, and mail/messenger services.', '', 'AS', '', 7, 1, 17639),
(19386, 45, 3983, 'Leadership and Management', '', 'Processes associated with establishing and sharing a clear vision and the design, execution, and control of operations that convert resources into desired goods and services, and implement a company&#39;s business strategy.', '', 'LM', '', 1, 1, 17640),
(19387, 45, 3983, 'Business Development', '', 'Processes aimed at developing and implementing growth opportunities, and communicating the value of a product, service or brand.', '', 'BD', '', 4, 1, 17636),
(19388, 45, 3983, 'Information Technology', '', 'Processes and practices that gauge the end-to-end delivery of IT solutions and those used to manage the composite hardware, software, network resources and services comprising an enterprise IT environment.', '', 'IT', '', 5, 1, 17637),
(19389, 45, 3983, 'Finance', '', 'Processes associated with general accounting and financial operations, time entry, billing and collections, accounts payable, expense reports, analyzing money flows, and meeting all reporting, tax, and business operation requirements.', '', 'FN', '', 2, 1, 17634),
(19390, 45, 3983, 'Human Resources', '', 'Processes related to searching for and obtaining candidates, employee training and development, various forms of direct and indirect employee compensation, administration of the employer-employee relationship, employee communication, and managing and retaining valuable employees.', '', 'HR', '', 3, 1, 17635),
(19391, 45, 3984, 'Administrative Management', '', 'The design, execution, and control of personnel and other resources for the purpose of producing and delivering desired goods and services that support the organization&#39;s business strategy.', '', 'AM', '', 3, 1, 17643),
(19392, 45, 3984, 'Practice Management', '', 'The design, execution, and control of legal practice operations that convert resources into desired goods and services, and implement a company&#39;s business strategy.', '', 'PM', '', 2, 1, 17642),
(19393, 45, 3984, 'Leadership', '', 'Establishing and sharing a clear vision, providing the information, knowledge and methods to realize that vision, and coordinating and balancing the conflicting interests of all members and stakeholders.', '', 'LD', '', 1, 1, 17641),
(19394, 45, 3985, 'Reputation Management', '', 'Maintaining or creating a certain frame of mind or brand regarding public perceptions. Reputation management is the process of identifying what other people are saying or feeling about you or your business; assessing the information (analytics); and taking steps to ensure that the general consensus is in line with established goals. Various forms of social media are commonly used to monitor reputations as well as focused efforts such as surveys, interviews, meetings, etc.', '', '25', '', 4, 1, 17648),
(19395, 45, 3985, 'Strategic Planning', '', 'Formulating objectives, practices and policies aimed at meeting short and long-range organizational needs and opportunities. It includes the strategic planning process, the process of aligning operational plans with the strategic plan, the allocation of resources, and the modification of governance structures to achieve strategic objectives.', '', '15', '', 2, 1, 17646),
(19396, 45, 3985, 'Ethics and Corporate Social Responsibility', '', 'Developing and integrating organizational values and their expression in business decision making and behavior. This emphasizes an organizational codes of ethics but includes relevant legal requirements.', '', '20', '', 3, 1, 17647),
(19397, 45, 3985, 'Crisis Management', '', 'Mitigating loss to business operations.  Drafting or distributing press statements/releases or otherwise sharing information publicly to limit the impact of negative news such as office closures, key personnel departures, etc.', '', '30', '', 5, 1, 17644),
(19398, 45, 3985, 'Governance', '', 'Establishing policies, and continuous monitoring of their proper implementation, by the members of the governing body of an organization. It includes the mechanisms required to balance the powers of the members (with the associated accountability), and their primary duty of enhancing the prosperity and viability of the organization.', '', '10', '', 1, 1, 17645),
(19399, 45, 3986, 'Legal Project Management', '', 'The Specific legal project management methodologies and the planning, organizing, motivating, and controlling resources to achieve specific goals related to legal cases or matters.', '', '25', '', 4, 1, 17652),
(19400, 45, 3986, 'Practitioner Compliance Monitoring', '', 'Ensuring all practitioners are properly licensed to practice and meet required continuing education (CLE, CPE, etc.) requirements for their practice.  It includes associated internal and external reporting requirements.', '', '20', '', 3, 1, 17651),
(19401, 45, 3986, 'Client Service', '', 'The provision of service to clients before, during and after a purchase.  Client service concerns the priority an organization assigns to client service relative to components such as product innovation and pricing.', '', '15', '', 2, 1, 17650),
(19402, 45, 3986, 'Relationship Management', '', 'Managing and supervising client/customer relationships.  It includes assigning of resources, defining scope of work, and establishing the operational and financial terms of service. Includes adherence to defined requirements for reporting, staffing, etc.', '', '10', '', 1, 1, 17649),
(19403, 45, 3987, 'Value', '', 'Providing services above the regular, routine representation adds value to the client.', '', '10', '', 1, 1, 17654),
(19404, 45, 3987, 'Customer Service', '', 'Meeting customer&#39;s needs by providing and delivering professional, helpful, high quality service and assistance before, during, and after the customer&#39;s requirements are met. Customer service is meeting the needs and desires of any customer. Some characteristics of good customer service include promptness, politeness, professionalism and personalization.', '', '15', '', 2, 1, 17655),
(19405, 45, 3987, 'Professional Services', '', 'Recognizing and making appropriate referrals to other services, for example, tax assistance or psychological services, when clients require assistance with matters outside the organizations expertise.', '', '20', '', 3, 1, 17653),
(19406, 45, 3988, 'Information Management', '', 'Documenting and managing internal strategic and operational business information.  It includes the protection of personally identifiable information (PII or PHI) and the prevention of unauthorized access to organizational information systems and confidential information.', '', '25', '', 11, 1, 17664),
(19407, 45, 3988, 'Industry Surveys', '', 'Collecting and submitting statistical and operation information to facilitate the organization&#39;s participation in sponsored industry surveys and analysis programs.', '', '30', '', 12, 1, 17663),
(19408, 45, 3988, 'Purchasing', '', 'Obtaining or buying goods and services. The process includes preparation and processing of a demand as well as the end receipt and approval of payment.', '', '35', '', 13, 1, 17661),
(19409, 45, 3988, 'Supplier Relationship Management (SRM)', '', 'Specifying, obtaining and managing products or services provided by suppliers (includes contractors, subcontractors, vendors and business partners). The purpose of supply management procedures is to keep costs stable and use resources effectively to increase the profits and efficiency of the business or organization.', '', '40', '', 14, 1, 17662),
(19410, 45, 3988, 'Business Continuity', '', 'Planning, preparation and related activities intended to ensure that during and after a serious incident or disaster an organization&#39;s critical business functions will either continue to operate, or will be recovered to an operational state within a reasonably short period.', '', '50', '', 15, 1, 17660),
(19411, 45, 3988, 'Planning and Analysis', '', 'The planning and analysis of operations and personnel including development and implementation of alternative staffing models (outsourcing), staffing analysis (ratios), succession planning and changes to the organizational structure.', '', '20', '', 4, 1, 17658),
(19412, 45, 3988, 'Emergency Preparedness', '', 'Preparing for and responding to unplanned events that can cause death or significant injury to employees, customers or the public; shut down your business, disrupt operations, cause physical or environmental damage; or threaten the facilities financial standing or public image.', '', '45', '', 5, 1, 17659),
(19413, 45, 3988, 'Policy Development', '', 'The development, review, and maintenance of basic principles and associated guidelines formulated and enforced by the governing body of an organization, to direct and limit its actions, and those of its employees and agents, in pursuit of the organizations long-term goals and regulatory and compliance requirements.', '', '15', '', 2, 1, 17657),
(19414, 45, 3988, 'Personnel Management', '', 'The management and supervision of personnel. Includes supervision of work product quality, work flow, performance assessments, personnel and resource transfers, and facilitating collaboration and team building to maximize productivity.', '', '10', '', 1, 1, 17656),
(19415, 45, 3989, 'Planning', '', 'Gathering information about hazards and assess risks, conducting a business impact analysis (BIA), and examining ways to prevent hazards and reduce risks. Includes writing a preparedness plan addressing resource management, emergency response, crisis communications, business continuity, information technology, employee assistance, incident management, and training.', '', '15', '', 2, 1, 17670),
(19416, 45, 3989, 'Program Management', '', 'The organization, development and administration of preparedness program.  It includes the identification of regulations that establish minimum requirements.', '', '10', '', 1, 1, 17669),
(19417, 45, 3989, 'Improvement', '', 'Identifying when the preparedness program needs to be reviewed.  Discovering methods to evaluate the preparedness program and utilize the review to make necessary changes and plan improvements.', '', '30', '', 5, 1, 17666),
(19418, 45, 3989, 'Implementation', '', 'Implementing a preparedness plan addressing resource management, emergency response, crisis communications, business continuity, information technology, employee assistance, incident management, and training.', '', '20', '', 3, 1, 17667),
(19419, 45, 3989, 'Testing', '', 'Plan testing and evaluation. Includes defining different types of exercises, learning how to conduct exercises, and using exercise results to evaluate the effectiveness of the plan.', '', '25', '', 4, 1, 17668),
(19420, 45, 3989, 'Execution', '', 'Identifying and assessing an emergency situation and executing an emergency plan.', '', '35', '', 6, 1, 17665),
(19421, 45, 3990, 'Financial Planning', '', 'Processes related to budgeting, forecasting, financial analysis, reporting and audit services.  Entails analyzing short-term and long-term money flows to and from an organization to optimize profits and make the best use of available funds.', '', 'FP', '', 3, 1, 17674),
(19422, 45, 3990, 'Tax and Compliance', '', 'Meeting all reporting, tax, and business operation requirements.', '', 'TX', '', 4, 1, 17672),
(19423, 45, 3990, 'Financial Operations', '', 'General accounting and financial operations.', '', 'FO', '', 2, 1, 17673),
(19424, 45, 3990, 'Credit and Collections', '', 'The accumulation of transactions (time keeping), the presentation of transactions for payment (billing), and the collection and recording of receivables.', '', 'CC', '', 1, 1, 17671),
(19425, 45, 3991, 'Banking Relationships', '', 'Managing relationships with banks or other financial institutions. Includes managing a line of credit and other forms of debt.', '', '30', '', 5, 1, 17679),
(19426, 45, 3991, 'International Finance', '', 'Addressing international monetary and financial business affairs so that company accounts are understandable and comparable across international boundaries. Includes handling conversions of funds to different currencies and addressing conversion rates to minimize exchange shortfalls.', '', '25', '', 4, 1, 17678),
(19427, 45, 3991, 'Invoicing (Billing)', '', 'Creating and submitting a bill for services and related costs to clients/customers. Includes producing transmittal letters and related reports, metrics, or similar analysis and adherence to established guidelines.  Also includes the transmission of billing information in various forms (paper, electronic, etc.).', '', '15', '', 2, 1, 17676),
(19428, 45, 3991, 'Accounts Receivable', '', 'Tracking and collecting funds owed from the sale of products or services on credit.', '', '20', '', 3, 1, 17677),
(19429, 45, 3991, 'Service Pricing', '', 'Developing, managing and approving billing or cost of service arrangements (guidelines, rates, terms, Alternative Fee Arrangements (AFA&#39;s), etc.).  It includes global or regional pricing policy development and management of MSA&#39;s (Master Service Agreements).', '', '10', '', 1, 1, 17675),
(19430, 45, 3992, 'Trust Accounts', '', 'Managing trust and escrow accounts. Includes controlled monies and other interest bearing accounts (IOLTA) and related regulatory reporting.', '', '20', '', 3, 1, 17682),
(19431, 45, 3992, 'Payroll Administration', '', 'Ensuring that all employees are paid accurately and timely with the correct withholdings and deductions, as designated within the respective legal and regulatory jurisdiction where employment occurs. This includes salary payments, tax withholdings, and deductions from paychecks.  This category also includes Accurate and timely payments of taxes and withholdings to applicable governmental agencies and taxing authorities.', '', '25', '', 4, 1, 17683),
(19432, 45, 3992, 'Accounts Payable', '', 'The processing of expense reimbursements, vendor payments, and other forms of money owed to suppliers for good or services rendered.', '', '10', '', 1, 1, 17680),
(19433, 45, 3992, 'General Accounting', '', 'Account reconciliations, closing of books, journal entries, accruals, and related activities.', '', '15', '', 2, 1, 17681),
(19434, 45, 3993, 'Capital Management', '', 'Ensuring an organization is able to continue its operations and that it has sufficient ability to satisfy both maturing short-term debt and upcoming operational expenses. The management of working capital involves managing inventories, accounts receivable and payable, and cash.', '', '35', '', 6, 1, 17689),
(19435, 45, 3993, 'Audit Services', '', 'Examining financial records and reporting activities. An audit may be conducted for disclosure, compliance, taxation, legal or other purposes. The examiner will check for accuracy and full representation of financial activities and claims.', '', '30', '', 5, 1, 17688),
(19436, 45, 3993, 'Financial Analysis', '', 'Analyzing financial statistics and data to identify historical performance, project future results, and recommend changes to increase the likelihood of achieving established goals. Includes defining objectives to provide metrics and dashboards that drive efficiencies and optimize spend, etc.', '', '20', '', 3, 1, 17687),
(19437, 45, 3993, 'Forecasting', '', 'Developing and analyzing statistics, data and models to predict financial results or the financial impact of strategic management decisions or operations.', '', '15', '', 2, 1, 17686),
(19438, 45, 3993, 'Budgeting', '', 'Developing financial models that represent a planned outcome of the future as defined by the business objective.  It outlines where funds will be spent and how that spending will be financed.  Types of budgets include operating, capital, cost center, practice, and legal matter (case).', '', '10', '', 1, 1, 17685),
(19439, 45, 3993, 'Financial Reporting', '', 'Establishing parameters and outputs to meet established reporting requirements. This includes data mining, query development, and related activities. Also includes participation in surveys related to financial performance and statistics.', '', '25', '', 4, 1, 17684),
(19440, 45, 3994, 'Business Insurances', '', 'The management of all business insurances other than professional liability (see RM35).', '', '20', '', 3, 1, 17692),
(19441, 45, 3994, 'Regulatory and Compliance Monitoring', '', 'Ensuring that regulations and sanctions imposed by a government agency are being met. Includes monitoring varying transaction types (cards, wire, ACH, etc.) for potential fraud, abuse or risk payments and meeting both internal and external reporting requirements.', '', '15', '', 2, 1, 17691),
(19442, 45, 3994, 'Tax and Reporting Services', '', 'Meeting local, state, and federal income, property or other tax and reporting requirements. Includes management of corporate, partner, shareholder, and similar tax and financial reporting requirements.', '', '10', '', 1, 1, 17690),
(19443, 45, 3995, 'Training and Development', '', 'Teaching or developing any skills and knowledge that relate to specific useful and/or required competencies. This may include new hire job training, technology competency, soft skills enhancement, professional development/regulatory compliance education, or employment-related required training.', '', 'TD', '', 5, 1, 17697),
(19444, 45, 3995, 'HR Advisory Services', '', 'Processes anticipated to help the organization manage and retain valuable employees, and to increase or maintain control over employment issues.', '', 'HA', '', 6, 1, 17698),
(19445, 45, 3995, 'Employment Relationships and Counseling', '', 'Analyzing, developing, implementing and administering the employer-employee relationship.  It includes performing continuing evaluation of it; managing employee performance; ensuring that relations with employees comply with applicable international, federal, state and local laws and regulations; and resolving workplace disputes.', '', 'ER', '', 4, 1, 17696),
(19446, 45, 3995, 'Compensation and Payroll', '', 'The various forms of direct compensation that employers use to attract, recognize and retain workers. Includes designing and administering compensation models including base pay, differential and incentive pay, and overtime.', '', 'CP', '', 2, 1, 17694),
(19447, 45, 3995, 'Benefit Programs', '', 'Various forms of indirect employee compensation used to attract, recognize and retain workers. It includes designing and administering benefits such as paid leave, insurance, retirement plans and various employee services, as well as various benefits mandated by international, federal, state and local laws and regulations.', '', 'BN', '', 3, 1, 17695),
(19448, 45, 3995, 'Recruitment and Selection', '', 'Processes related to searching for and obtaining a pool of potential candidates with the desired knowledge, skills and abilities necessary to effectively conduct the business of the legal operation. Includes processes necessary to effectively facilitate the selection of the most appropriate candidates to fill job vacancies against defined position descriptions and specifications. Affirmative Action, Equal Employment Opportunity and Diversity regulations, programs and policies are integrated into these activities.', '', 'RS', '', 1, 1, 17693),
(19449, 45, 3996, 'Recruitment Strategy', '', 'Developing and maintaining a recruitment strategy to ensure the organization has the necessary knowledge, skills and abilities (KSA&#39;s) to meet current and future strategic and operational requirements.  It includes adherence to internal and external (i.e. government, client, customer) staffing requirements (i.e. contractor/sub-contractor requirements, diversity goals, professional credentials, etc.).', '', '15', '', 2, 1, 17702),
(19450, 45, 3996, 'Staffing Management', '', 'Sourcing, recruiting, hiring and retaining the human resources needed to support business objectives. It includes processes for management of pre-employment screening and testing, contingent staffing, retention strategies, recruitment technologies, recruitment process outsourcing, and workforce planning.', '', '10', '', 1, 1, 17701),
(19451, 45, 3996, 'Applicant Recruitment', '', 'Searching for and obtaining a pool of potential candidates with the desired knowledge, skills and abilities and the use of processes and technologies designed to facilitate the applicant recruitment process.', '', '20', '', 3, 1, 17699),
(19452, 45, 3996, 'Eligibility Review and Certification', '', 'The selection of the most appropriate candidates to fill job vacancies against defined position descriptions and specifications.  It includes interviews, testing, background checks, verifications, employment eligibility/foreign worker sponsorship activities and credentialing.', '', '25', '', 4, 1, 17700),
(19453, 45, 3997, 'Payroll Administration', '', 'Ensuring that all employees are paid accurately and timely with the correct withholdings and deductions, as designated within the respective legal and regulatory jurisdiction where employment occurs. This includes salary payments, tax withholdings, and deductions from paychecks.  This category also includes Accurate and timely payments of taxes and withholdings to applicable governmental agencies and taxing authorities.', '', '15', '', 2, 1, 17704),
(19454, 45, 3997, 'Reward Management', '', 'Analyzing and controlling employee remuneration, compensation and all of the other benefits for the employees. Reward management aims to create and efficiently operate a reward structure for an organization. Reward structure usually consists of pay policy and practices, salary and payroll administration, total reward, minimum wage, executive pay and team reward.  It includes monitoring and adherence to guidelines established to prevent discrimination and assure equality of compensation.', '', '10', '', 1, 1, 17703),
(19455, 45, 3998, 'Retirement Programs', '', 'Designing, administering and managing retirement income benefit offerings (401(k), profit sharing, defined contribution, etc.). Includes The transfer of information related to withholding and deduction of retirement planning costs (when applicable) to processes in the Payroll Administration (CP15) category of the Compensation and Payroll (CP) substantive area, as well as the Employment Advisory Services (HA30) category of the HR Advisory Services (HA) substantive area where such information is documented.', '', '15', '', 2, 1, 17708),
(19456, 45, 3998, 'Non-Compensation Programs', '', 'Designing, administering and managing non-compensation benefit offerings (paid time off (PTO), wellness, etc.). Includes The transfer of information related to tracking and reporting of non-compensation program information (when applicable) to processes in the Payroll Administration (CP15) category of the Compensation and Payroll (CP) substantive area, as well as the Employment Advisory Services (HA30) category of the HR Advisory Services (HA) substantive area where such information is documented.', '', '20', '', 3, 1, 17707),
(19457, 45, 3998, 'Mandated Programs', '', 'The administration of mandated benefit programs (unemployment, workersâ€™ compensation, etc.).', '', '25', '', 4, 1, 17706),
(19458, 45, 3998, 'Insurance Programs', '', 'Designing, administering and managing benefit offerings (Medical, LTD, STD, Life, etc.). Includes The transfer of information related to withholding and deduction of insurance costs (when applicable) to processes in the Payroll Administration (CP15) category of the Compensation and Payroll (CP) substantive area.', '', '10', '', 1, 1, 17705),
(19459, 45, 3999, 'Personnel Records/Files', '', 'The maintenance and organization of personnel documents used to determine an employeeâ€™s qualifications for employment, promotion, transfer, additional compensation, disciplinary action, or discharge.', '', '40', '', 7, 1, 17715),
(19460, 45, 3999, 'Performance Systems', '', 'The administration and management of evaluation or performance management systems.', '', '20', '', 3, 1, 17713),
(19461, 45, 3999, 'Diversity Awareness', '', 'Understanding the differences and similarities that make individuals unique, such as individual and organizational characteristics, values, beliefs, experiences, backgrounds, preferences and behaviors, as well as how organizations can leverage those qualities in support of business objectives.  It includes identification of training needs in conjunction with processes in the Training and Development (TD) substantive area, as well as the development and implementation of policies in the Policy Management (HA10) category of the HR Advisory Services (HA) substantive area.', '', '25', '', 4, 1, 17714),
(19462, 45, 3999, 'Counseling', '', 'Employee actions that focus on a specific incident, a particular aspect of an employee&#39;s performance, or the employee&#39;s overall performance or conduct.', '', '30', '', 5, 1, 17711),
(19463, 45, 3999, 'Career Planning', '', 'A broad range of services that include individual career counseling, resume and cover letter development, interview training, and job search assistance.  It includes identification of education and professional development training needs in conjunction with processes in the Training and Development (TD) substantive area.', '', '15', '', 2, 1, 17712),
(19464, 45, 3999, 'Engagement', '', 'Employee recognition, special service rewards, or similar employee engagement activities.', '', '10', '', 1, 1, 17709),
(19465, 45, 3999, 'Grievance and Complaint Resolution', '', 'The investigation and fair and equitable resolution of complaints, misunderstandings, and grievances for employees, owners, and business partners associated with the organization&#39;s business operations.', '', '35', '', 6, 1, 17710),
(19466, 45, 4000, 'Plan Development and Monitoring', '', 'The establishment and maintenance of learning management systems (LMS).  It includes development of skill and competency standards desired or required for various populations within the legal operation.', '', '30', '', 5, 1, 17720),
(19467, 45, 4000, 'Assessments', '', 'The development and administration of testing methods and systems designed to assess competencies desired or required for employment or advancement within a legal operation.', '', '25', '', 4, 1, 17719),
(19468, 45, 4000, 'Delivery', '', 'The delivery of programs to improve professional, technical, and personal skills and abilities. Also includes delivery of programs to educate members of legal operations about policies pertaining to harassment, anti-insider trading, diversity and inclusion and other employment-related issues.', '', '20', '', 3, 1, 17718),
(19469, 45, 4000, 'Organizational and Employee Development', '', 'Organizational performance and the means by which it develops its human resources. Activities address improving organizational effectiveness and training employees to meet current and future job demands. Also includes change management, coaching, leadership development, succession planning, career development, social networking, measurement systems and outsourcing employee development. Includes the process of knowledge sharing and the transfer of knowledge from departing personnel.', '', '10', '', 1, 1, 17717),
(19470, 45, 4000, 'Program Development', '', 'The development of programs to improve professional, technical, and personal skills and abilities. Also includes development of programs to educate members of legal operations about policies pertaining to harassment, anti-insider trading, diversity and inclusion and other employment-related issues.', '', '15', '', 2, 1, 17716),
(19471, 45, 4001, 'Labor Relations', '', 'Formal labor-management relations such as protected activities, unfair practices, union organizing, recognition and representation elections as well as collective bargaining and contract administration.', '', '35', '', 6, 1, 17726),
(19472, 45, 4001, 'Safety and Security', '', 'Enterprise and employee safety and security. Includes processes to prevent and/or mitigate loss, risk to or from personnel, threats to its physical assets, damage to its technology and intellectual property, and risks arising from all elements surrounding the work environment.', '', '40', '', 7, 1, 17727),
(19473, 45, 4001, 'Employment Advisory Services', '', 'Advising regarding hiring, evaluation, documentation and termination decisions.  It includes compensation and retention programs and negotiating and documenting offer letters, employment, consulting, non-compete, non-solicitation and separation agreements and other related documents.', '', '30', '', 5, 1, 17725),
(19474, 45, 4001, 'Global Human Resources', '', 'HR operations within the worldwide contextâ€”including U.S.-based entities doing business internationally and non-U.S.-based entities operating in their own locale or worldwide. Includes matters such as management of global workforces, expatriation and repatriation, HR practices and laws around the world, and those arising in specific countries and regions.  Processes may be integrated with other substantive areas to ensure compliance with international standards, practices and regulations.', '', '20', '', 3, 1, 17724);
INSERT INTO `tblQuestion` (`question_id`, `survey_id`, `page_id`, `question_desc`, `question_desc_alt`, `question_extra`, `question_extra_alt`, `question_code`, `question_UTBMS`, `question_seq`, `question_enabled`, `question_id_original`) VALUES
(19475, 45, 4001, 'Staffing Management', '', 'The strategies, tactics and processes for sourcing, recruiting, hiring, retaining, and terminating the human resources needed to support business objectives. Includes processes for management of pre-employment screening and testing, contingent staffing, retention strategies, recruitment technologies, recruitment process outsourcing, staffing metrics, and workforce planning.', '', '15', '', 2, 1, 17723),
(19476, 45, 4001, 'Resource Planning', '', 'Classification plan administration, classification analysis, staffing (ratio) analysis, succession planning, and similar activities.  It includes the assessment of temporary, short-term and long-term outsourcing opportunities.', '', '25', '', 4, 1, 17721),
(19477, 45, 4001, 'Policy Management', '', 'The developing, implementing, or revising policies and procedures, including employee handbooks and policy materials, addressing such subjects as conflicts of interest, alternative dispute resolution, confidentiality, trade secrets, intellectual property, restrictive covenants and severance.  It includes activities that ensure all members of a legal operation are in compliance with policy-related educational requirements, have sufficient access to policy information, have been made effectively aware of policies and policy changes, and efficiently maintain proof of such activities and compliance actions.', '', '10', '', 1, 1, 17722),
(19478, 45, 4002, 'Marketing', '', 'The communication of the value of a product, service or brand to customers or consumers for the purpose of promoting or selling that product, service, or brand.', '', 'MK', '', 3, 1, 17729),
(19479, 45, 4002, 'Service Development', '', 'The creation of products with new or different characteristics that offer new or additional benefits to the customer. Product development may involve modification of an existing product or its presentation, or formulation of an entirely new product that satisfies a newly defined customer want or market niche.', '', 'PD', '', 1, 1, 17728),
(19480, 45, 4002, 'Sales', '', 'Interpersonal and public interactions with prospects and customers to promote collective or individual abilities, educate regarding specific services being offered or sought, and obtain commitments to acquire said services.', '', 'SL', '', 2, 1, 19129),
(19481, 45, 4003, 'Product Refinement', '', 'The refinement or enhancement of products or services to exploit new or different characteristics that offer new or additional benefits to the customer.', '', '20', '', 3, 1, 17732),
(19482, 45, 4003, 'Product Analysis', '', 'The analysis of products and services to identify new or different characteristics that offer new or additional benefits to the customer.', '', '15', '', 2, 1, 17731),
(19483, 45, 4003, 'Competitive Intelligence', '', 'Collecting and analyzing information about competitorsâ€™ strengths and weaknesses in a legal and ethical manner to enhance business decision-making.', '', '10', '', 1, 1, 17730),
(19484, 45, 4004, 'Consumer Research', '', 'The identification of the preferences, motivations, and buying behavior of the targeted customer.', '', '20', '', 3, 1, 17735),
(19485, 45, 4004, 'Data Collection and Analysis', '', 'The collection and analysis of marketing, product, and consumer information from direct observation of the consumers, mail surveys, interviews, and from published sources.', '', '25', '', 4, 1, 17736),
(19486, 45, 4004, 'Market Research', '', 'The identification of a specific market and measurement of its size and other characteristics.', '', '10', '', 1, 1, 17733),
(19487, 45, 4004, 'Product Research', '', 'The identification of a need or want and the characteristic of the goods or services that will satisfy it.', '', '15', '', 2, 1, 17734),
(19488, 45, 4005, 'Content Management', '', 'Managing the strategy, creation and distribution of messages or statements to the public by any means such as print, radio, television, internet, etc.', '', '30', '', 5, 1, 19139),
(19489, 45, 4005, 'Event Planning', '', 'Planning and coordinating events.  It includes budgeting, scheduling, staff selection, site selection, acquiring necessary permits, coordinating transportation and parking, arranging for speakers or entertainers, arranging decor, event security, managing invitee lists, catering and emergency plans.', '', '35', '', 6, 1, 17747),
(19490, 45, 4005, 'Graphic Design', '', 'Designing and producing graphical content for internal and external communications including pitches, brochures, reports, fact sheets, posters, web and other marketing materials.', '', '25', '', 4, 1, 17744),
(19491, 45, 4005, 'Database Management (CRM)', '', 'Operating computer programs or database management systems (DBMS) that catalog, index, locate, retrieve, and store data, maintains its integrity, and outputs it in the form desired by a user. Its overall purpose is to organize and manage data, and make it available on demand.', '', '20', '', 3, 1, 17743),
(19492, 45, 4005, 'Practitioner Listings and Directories', '', 'Maintaining the accuracy of and participation in listing and directories of practitioner skills, abilities and biographical information.', '', '10', '', 1, 1, 17740),
(19493, 45, 4005, 'Practitioner Honors and Awards', '', 'Obtaining and maintaining accurate information regarding practitioner honors, awards, and recognitions in order to assure appropriate promotion for marketing purposes.', '', '15', '', 2, 1, 17741),
(19494, 45, 4006, 'Information Systems Administration', '', 'Providing guidance on system preferences and implementation, database administration, commissioning/decommissioning/developing systems, and information migration.', '', 'IA', '', 3, 1, 17750),
(19495, 45, 4006, 'IT Services', '', 'Processes and practices that gauge the end-to-end delivery of IT solutions rather than their development. These processes measure the operational efficiency of a solution in meeting the service level expectations of the end-user and how technical IT manages these systems to deliver the desired service level.', '', 'IS', '', 1, 1, 17748),
(19496, 45, 4006, 'IT Infrastructure', '', 'The composite hardware, software, network resources and services required for the existence, operation and management of an enterprise IT environment.', '', 'II', '', 2, 1, 17749),
(19497, 45, 4007, 'IT Solution Development', '', 'Developing, testing and debugging an application or program, or a networking or hardware solution.', '', '10', '', 1, 1, 17751),
(19498, 45, 4007, 'User Support Services', '', 'Providing onsite, remote or helpdesk user support and user account administration.  It includes development, use and maintenance of knowledge databases, incident ticketing systems, issue reporting tools and the capture of issue resolutions.', '', '15', '', 2, 1, 17752),
(19499, 45, 4008, 'Peripheral Management', '', 'Installing, configuring and maintaining internal or external devices that connect directly to a computer but do not contribute to the computer&#39;s primary function, such as computation of data. These devices are intended to help end users interface with an information technology system or subsystem.', '', '20', '', 3, 1, 17755),
(19500, 45, 4008, 'Network Management', '', 'The administration, operation, and reliable maintenance of computer network systems. Strictly speaking, network management does not include hardware.  Rather, it concerns the reliability, accessibility, security, efficiency, capacity, and capabilities of data transfer channels.', '', '25', '', 4, 1, 17756),
(19501, 45, 4008, 'Computer Management', '', 'Managing, monitoring and optimizing all computing devices for performance, availability, device security and/or any base operational requirement. Includes manual and automated administrative processes.', '', '15', '', 2, 1, 17754),
(19502, 45, 4008, 'IT System Integration', '', 'Joining different subsystems or components into one inter-connected system. It ensures that each integrated subsystem functions as required. It is also used to add value to a system through new functionalities provided by connecting functions of different systems.', '', '10', '', 1, 1, 17753),
(19503, 45, 4009, 'Change Management', '', 'The management of transformational activities associated with the adoption of policies or practices.', '', 'CH', '', 7, 1, 17763),
(19504, 45, 4009, 'Business Intelligence', '', 'Applying a set of techniques and tools for the transformation of raw data into meaningful and useful information for business analysis purposes. BI technologies are capable of handling large amounts of unstructured data to help identify, develop and otherwise create new strategic business opportunities.', '', 'BI', '', 4, 1, 17760),
(19505, 45, 4009, 'Project Management', '', 'The application of specific project management methodologies - planning, organizing, motivating, and controlling resources to achieve specific goals and meet objectives of tactical projects.', '', 'PG', '', 5, 1, 17761),
(19506, 45, 4009, 'Operational Excellence', '', 'The application of principles, systems, and tools used toward the sustainable improvement of key practice performance metrics.', '', 'OE', '', 6, 1, 17762),
(19507, 45, 4009, 'Information Governance', '', 'The multi-disciplinary structures, policies, procedures, processes and controls implemented to manage information at an enterprise level, supporting an organization&#39;s immediate and future regulatory, legal, risk, environmental and operational requirements.', '', 'IG', '', 1, 1, 17757),
(19508, 45, 4009, 'Risk Management', '', 'The identification, analysis, assessment, control, and avoidance, minimization, or elimination of unacceptable risks. An organization may use risk assumption, risk avoidance, risk retention, risk transfer, or any other strategy (or combination of strategies) in proper management of future events.', '', 'RM', '', 2, 1, 17758),
(19509, 45, 4009, 'Knowledge Management', '', 'Organizing, managing and mobilizing the knowledge and expertise of an organization.  KM also includes the processes, technology and culture within an organization that facilitates and supports successful knowledge management.', '', 'KM', '', 3, 1, 17759),
(19510, 45, 4010, 'Retention/Disposition', '', 'Applying lifecycle management practices to stored information, enacting disposition as authorized, and applying defensible disposition to legacy information.', '', '55', '', 10, 1, 17773),
(19511, 45, 4010, 'Records and Information Management (RIM)', '', 'Creating and periodically revising operational guidelines for managing information assets, including file folder structures and taxonomy.', '', '45', '', 8, 1, 17771),
(19512, 45, 4010, 'Document Preservation and Mandated Destruction', '', 'Preserving potentially responsive information, ensuring the suspension of scheduled disposition, and certifying custodial legal hold compliance during the discovery phase of litigation, investigations or audits. Also the destruction of information as mandated by the court or by agreement among parties.', '', '50', '', 9, 1, 17772),
(19513, 45, 4010, 'Matter Mobility', '', 'Moving matters and their associated information into and out of law firms or legal departments; triggered by lateral moves, representation terminations, and other events.', '', '40', '', 7, 1, 17770),
(19514, 45, 4010, 'Matter Lifecycle Management', '', 'Capturing new engagement information that is organized by areas of law and/or practice groups, including engagement documentation and perpetuating the collection/distribution of authoritative information. The process of systematically deactivating matters in matter management systems at the conclusion of formal representations (matter closing) is also part of this umbrella process.', '', '35', '', 6, 1, 17769),
(19515, 45, 4010, 'Mobile Devices/BYOD', '', 'Providing guidance on compliance with policies/procedures with respect to acceptable use and security of company-issued and personally owned devices (i.e., â€œbring your own deviceâ€ or BYOD).', '', '30', '', 5, 1, 17768),
(19516, 45, 4010, 'Information Security', '', 'Delivering proactive cyber security prevention, protection, and response services.  Provides an objective perspective on the current cybersecurity posture of the organization&#39;s operational/business networks. Includes management of ethical walls, confidential access controls and the protection of personally identifiable information (PII or PHI).', '', '20', '', 3, 1, 17766),
(19517, 45, 4010, 'Information Requests', '', 'Responding efficiently, consistently, and appropriately to requests for information, including Request for Proposal (RFP) responses, questionnaires, surveys, counsel guidelines, and audits.', '', '25', '', 4, 1, 17767),
(19518, 45, 4010, 'Intellectual Property', '', 'Capturing and preserving knowledge and operational, creative, and historical artifacts that hold commercial, business, or strategic value (e.g., marketing and branding materials).  It includes knowledge management resources, contact information, business development strategies, strategic plans, case management strategies, financial information, policies and procedures.', '', '15', '', 2, 1, 17765),
(19519, 45, 4010, 'Information Management&#9;', '', 'Documenting and managing internal strategic and operational business information.  It includes controlling access to information and the protection of personally identifiable information (PII or PHI) and confidential information.', '', '10', '', 1, 1, 17764),
(19520, 45, 4011, 'Cyber Hygiene', '', 'Monitoring publicly accessible cyber assets, networks, and systems.  Focuses on the general health and wellness of the cyber perimeter by assessing Internet accessible systems for known vulnerabilities and configuration errors on a persistent basis.  Program benefits include third-party review, no-cost scanning services, reduced risk, a view of how the assessed network appears to an attacker, and actionable data for quick mitigation/results.', '', '15', '', 2, 1, 17775),
(19521, 45, 4011, 'Risk and Vulnerability', '', 'Securing individual stakeholders against known vulnerabilities and threats by providing mitigation strategies to reduce risk and to aggregate vulnerability data so policy makers can make informed decisions regarding the security and safety of information systems. Includes online assessments performed by security experts, launching targeted trial attacks, and testing incident response plans.', '', '10', '', 1, 1, 17774),
(19522, 45, 4012, 'Practitioner Compliance Monitoring', '', 'Ensuring that all practitioners are properly licensed to practice and meet required continuing education (CLE, CPE, etc.) requirements for their practice.  It includes associated internal and external reporting requirements and adherence to engagement requirements such as security clearances, etc.', '', '40', '', 7, 1, 17782),
(19523, 45, 4012, 'Regulatory and Compliance Monitoring', '', 'Ensuring that regulations and sanctions imposed by a government agency are being met. Includes monitoring varying transaction types (cards, wire, ACH, etc.) for potential fraud, abuse or risk payments and meeting both internal and external reporting requirements.', '', '45', '', 8, 1, 17783),
(19524, 45, 4012, 'Professional Liability and Ethics', '', 'Management of professional liability insurance, ethics investigations and other risk management activities. Includes the support of the organization in professional liability investigations, representation of the firm in legal matters, providing advice on matters internal to the firm (anti-bribery, corruption, etc.), the coordination of outside interests (approving, maintaining register, etc.), review and approval of engagement letter terms and conditions, and the coordination of practicing certificate and recognized body renewals.', '', '35', '', 6, 1, 17781),
(19525, 45, 4012, 'New Business Processing', '', 'Completing and reviewing new business intake information and processing of new business intake requests.  It includes researching new clients/customers (address, passports etc.), reviewing requests in relation to anti-money laundering (AML) and other business acceptance factors, communicating with partners or management to clarify information, and conducting search relating to AML and other business risk.  Also includes updating records to reflect changes in parties and scope, approving requests to re-open closed matters, and transferring time between clients and matters, open sub-matters, etc.', '', '25', '', 4, 1, 17779),
(19526, 45, 4012, 'Ethical Walls (Information Barriers)', '', 'Implementing and managing ethical walls.  It includes advising on set up procedures, providing consent wording, managing access requests, and removal of information barriers. Also includes advising on when consent is needed, assisting with drafting consent letters, and advising on use of information barriers.', '', '30', '', 5, 1, 17780),
(19527, 45, 4012, 'New Business Analysis', '', 'Analyzing prospective engagement information and other business acceptance risk issues, communicating with partners or management, and taking agreed upon actions.  This would include producing escalation reports for management for decisions on whether to accept work.', '', '20', '', 3, 1, 17778),
(19528, 45, 4012, 'Conflicts Processing', '', 'Reviewing new business requests in relation to conflicts of interest and alignment.  Includes communicating with partners or management to clarify potentially inaccurate information, conducting conflict of interest and related searches, and administration of risk assessment and information systems.', '', '15', '', 2, 1, 17777),
(19529, 45, 4012, 'Conflicts Analysis', '', 'Analyzing search results and resolving conflict issues by communicating with partners or management and taking agreed upon actions.  This would include decisions on whether representations can be accepted.', '', '10', '', 1, 1, 17776),
(19530, 45, 4013, 'Measure and Report', '', 'Developing metrics and analytics to report on benefits realized from new knowledge, expertise, process, technology and culture strategy.', '', '25', 'KM400', 4, 1, 17787),
(19531, 45, 4013, 'Maintain and Update', '', 'Maintaining enhanced levels of expertise, knowledge, processes, technology and culture, and validating against the vision defined previously.', '', '30', 'KM500', 5, 1, 17788),
(19532, 45, 4013, 'Assess and Evaluate', '', 'Identifying and evaluating the existing state of knowledge and expertise in the organization, and the supporting processes, technology and culture.', '', '10', 'KM100', 1, 1, 17784),
(19533, 45, 4013, 'Strategy and Planning', '', 'Defining and developing a strategy and plan to improve the current state of knowledge management based on the assessment and evaluation performed previously.', '', '15', 'KM200', 2, 1, 17785),
(19534, 45, 4013, 'Implementation', '', 'Planning and executing strategies associated with people, process, technology and culture.', '', '20', 'KM300', 3, 1, 17786),
(19535, 45, 4014, 'Benchmark Internally and Externally', '', 'Mapping the evaluation results from other processes within this category against the business objectives of the organization and benchmarking against peers and competitors.', '', '35', 'KM160', 6, 1, 17794),
(19536, 45, 4014, 'Identify and Evaluate Technology Supporting Processes', '', 'Identifying systems and the underlying technology used to enable internal and external knowledge and expertise to be developed and leveraged effectively, and the links and interfaces between them, and evaluating the efficiency, usability, and sustainability of these systems.', '', '25', 'KM140', 4, 1, 17792),
(19537, 45, 4014, 'Identify and Evaluate Culture', '', 'Identifying the cultural environment of the organization relevant to fostering the development and mobilization of knowledge and expertise and evaluating its impact.', '', '30', 'KM150', 5, 1, 17793),
(19538, 45, 4014, 'Identify and Evaluate Tacit Knowledge and Expertise', '', 'Identifying sources of unformalized (tacit) knowledge skills and expertise accessible internally and externally, and evaluating relevance/quality/usefulness of the knowledge, skills and expertise.', '', '15', 'KM120', 2, 1, 17790),
(19539, 45, 4014, 'Identify and Evaluate Processes Enabling Knowledge and Expertise to Flow', '', 'Identifying processes that exist to enable internal and external knowledge and expertise to be developed and leveraged effectively (collect, collate, retrieve, reuse, transform from unformalized to formalized, share, and transfer), evaluating the organizationâ€™s ability to collaborate effectively to maximize value from the knowledge, skills and expertise available, and evaluating efficiency/quality of these processes.', '', '20', 'KM130', 3, 1, 17791),
(19540, 45, 4014, 'Identify and Evaluate Explicit Knowledge', '', 'Identifying sources of formalized (explicit) knowledge accessible electronically from internal and external databases, systems, information platforms, e-mail newsletters etc., and evaluating the relevance, quality, and usefulness of this knowledge.', '', '10', 'KM110', 1, 1, 17789),
(19541, 45, 4015, 'Develop Technology Strategy', '', 'Defining and documenting technology strategy to put new systems in place, enhance and simplify existing systems and landscape, optimize interfaces and connections between systems and ease of use, aligned with the vision defined previously.', '', '30', 'KM250', 5, 1, 17799),
(19542, 45, 4015, 'Develop Culture Strategy', '', 'Defining and documenting strategy to remove cultural barriers, tackle knowledge hiding, incentivize knowledge sharing, aligned with the vision defined previously.', '', '35', 'KM260', 6, 1, 17800),
(19543, 45, 4015, 'Develop Change Management Strategy', '', 'Defining and documenting change management strategy to implement systems, processes, cultural change.', '', '40', 'KM270', 7, 1, 17801),
(19544, 45, 4015, 'Develop Knowledge and Expertise Strategy', '', 'Defining and documenting strategy to increase or improve the current knowledge and expertise available in the organization, aligned with the vision defined previously.', '', '20', 'KM230', 3, 1, 17797),
(19545, 45, 4015, 'Develop Process Strategy', '', 'Defining and documenting process strategy to enable knowledge and expertise to be accessed, retrieved, shared and leveraged, aligned with the vision defined previously.', '', '25', 'KM240', 4, 1, 17798),
(19546, 45, 4015, 'Formulate Vision', '', 'Developing the vision for the future state of knowledge management in the organization.', '', '10', 'KM210', 1, 1, 17795),
(19547, 45, 4015, 'Perform Gap Analysis', '', 'Identifying sources of knowledge and expertise, as well as processes, systems and cultural aspects that are needed to realize the vision but are currently lacking in the organization.', '', '15', 'KM220', 2, 1, 17796),
(19548, 45, 4016, 'Implement Change Management Strategy', '', 'Implementing the change management strategy defined previously.  It includes reviewing and validating strategic plan with stakeholders, developing project plan and documentation, preparing and rolling out communication plan, defining KPIs, and executing against project plan.', '', '30', 'KM350', 5, 1, 17806),
(19549, 45, 4016, 'Implement Process Strategy', '', 'Implementing the previously defined process strategy.  It includes reviewing and validating strategic plan with stakeholders, developing project plan and documentation, preparing and rolling out communication plan, defining KPIs, and executing against project plan.', '', '15', 'KM320', 2, 1, 17803),
(19550, 45, 4016, 'Implement Technology Strategy', '', 'Implementing the technology strategy defined previously.  It includes reviewing and validating strategic plan with stakeholders, developing project plan and documentation, preparing and rolling out communication plan, defining KPIs, and executing against project plan.', '', '20', 'KM330', 3, 1, 17804),
(19551, 45, 4016, 'Implement Culture Strategy', '', 'Implementing the culture strategy defined previously.  It includes reviewing and validating strategic plan with stakeholders, developing project plan and documentation, preparing and rolling out communication plan, defining KPIs, and executing against project plan.', '', '25', 'KM340', 4, 1, 17805),
(19552, 45, 4016, 'Implement Knowledge and Expertise Strategy', '', 'Implementing the knowledge and expertise strategy defined previously.  It includes reviewing and validating strategic plan with stakeholders, developing project plan and documentation, preparing and rolling out communication plan, defining KPIs, and executing against project plan.', '', '10', 'KM310', 1, 1, 17802),
(19553, 45, 4017, 'Report', '', 'Reviewing results and reporting on measurements performed previously.', '', '20', 'KM430', 3, 1, 17809),
(19554, 45, 4017, 'Define', '', 'Defining what to measure, how to measure it, and how often, with respect to knowledge and expertise, processes, technology and culture.', '', '10', 'KM410', 1, 1, 17807),
(19555, 45, 4017, 'Measure', '', 'Carrying out the measurements defined previously.', '', '15', 'KM420', 2, 1, 17808),
(19556, 45, 4018, 'Maintain Culture', '', 'Supporting and sustaining a culture of knowledge sharing to ensure continued alignment with the vision.', '', '30', 'KM550', 5, 1, 17814),
(19557, 45, 4018, 'Maintain/Support/Update Technology', '', 'Reviewing and maintaining systems and technical infrastructure supporting KM to ensure continued alignment with the vision.', '', '25', 'KM540', 4, 1, 17813),
(19558, 45, 4018, 'Maintain/Update Process Efficiency', '', 'Reviewing and maintaining processes supporting KM to ensure continued alignment with the vision.', '', '20', 'KM530', 3, 1, 17812),
(19559, 45, 4018, 'Maintain/Retain/Update Expertise', '', 'Reviewing and maintaining existing expertise, renewing and refreshing expertise, and retaining expertise within the organization, to ensure continued alignment with the vision.', '', '15', 'KM520', 2, 1, 17811),
(19560, 45, 4018, 'Maintain/Retain/Update Knowledge', '', 'Reviewing and maintaining knowledge, renewing and refreshing knowledge, and retaining knowledge within the organization to ensure continued alignment with the vision.', '', '10', 'KM510', 1, 1, 17810),
(19561, 45, 4019, 'Travel Management', '', 'The planning, management and support of travel activities.', '', 'TR', '', 5, 1, 17821),
(19562, 45, 4019, 'Communication Services', '', 'The coordination and management of electronic and telecommunication systems.', '', 'CM', '', 3, 1, 17819),
(19563, 45, 4019, 'Meetings Coordination', '', 'The planning, management and support of meetings.', '', 'MC', '', 4, 1, 17820),
(19564, 45, 4019, 'Word Processing', '', 'Producing and reproducing documents.', '', 'DS', '', 1, 1, 17817),
(19565, 45, 4019, 'Court and Registration Services', '', 'Court filing, litigation searching, docket maintenance, company and business name searching, property and title searching, and notary services.', '', 'CR', '', 2, 1, 17818),
(19566, 45, 4019, 'Facilities Management', '', 'Processes that encompass multiple disciplines intended to ensure functionality of the built environment by integrating people, place, process and technology.', '', 'FM', '', 6, 1, 17816),
(19567, 45, 4019, 'Mail and Messenger Services', '', 'The handling of mail or deliveries. It includes the review of incoming mail, processing of incoming and outgoing mail, shipping, and internal and external deliveries (excludes court runs).', '', 'MM', '', 7, 1, 17815),
(19568, 45, 4020, 'Document Reproduction', '', 'Reproducing, printing, scanning or finishing documents.', '', '20', '', 3, 1, 17824),
(19569, 45, 4020, 'Document Creation', '', 'Drafting, revising, proofreading or transcribing documents, presentations or correspondence.', '', '10', '', 1, 1, 17822),
(19570, 45, 4020, 'Document Management', '', 'The management and identification of electronic and physical documents (records).  It includes the adherence to established naming and organizational protocols and procedures to facilitate future retrieval.', '', '15', '', 2, 1, 17823),
(19571, 45, 4021, 'Proofreading Documents', '', 'The proofreading of documents for grammatical, spelling and format errors.', '', '15', '', 2, 1, 17826),
(19572, 45, 4021, 'Revising Documents', '', 'Editing documents from handwritten notes, annotated hard copy, transcription, shorthand, etc. Includes comparisons, conversions, merges, creation of tables of contents/authorities, etc.', '', '20', '', 3, 1, 17827),
(19573, 45, 4021, 'Drafting Documents', '', 'The initial drafting of documents from handwritten notes, annotated hard copies, shorthand, discussions, etc. Includes transcription, translation and court reporting. (Note: Drafting documents related to a legal representation independently should be classified within Legal Services).', '', '10', '', 1, 1, 17825),
(19574, 45, 4022, 'Audit trails', '', 'Permitting the reconstruction of who did what to a document during the course of its life in the system.', '', '30', '', 5, 1, 17832),
(19575, 45, 4022, 'Check-in/check-out Processes', '', 'Document check-in/check-out and document locking, to coordinate the simultaneous editing of a document so one personâ€™s changes donâ€™t overwrite anotherâ€™s.', '', '35', '', 6, 1, 17833),
(19576, 45, 4022, 'Version control', '', 'Tracking how the current document came to be, and how it differs from the versions that came before.  It includes roll-back, to â€œactivateâ€ a prior version in case of an error or premature release.', '', '25', '', 4, 1, 17831),
(19577, 45, 4022, 'Security and access control', '', 'Maintaining security and access control to documents.', '', '20', '', 3, 1, 17830),
(19578, 45, 4022, 'Physical Storage and Filing', '', 'Creating physical files adhering to established file organization conventions.  It includes and management of document storage and organization.', '', '15', '', 2, 1, 17828),
(19579, 45, 4022, 'Electronic Storage and Naming', '', 'Creating and adhering to established document naming conventions and management of document electronic storage.', '', '10', '', 1, 1, 17829),
(19580, 45, 4023, 'Printing', '', 'Printing electronic documents to hard copy.', '', '20', '', 3, 1, 17836),
(19581, 45, 4023, 'Scanning', '', 'Scanning printed materials to various file formats for uses other than reproduction.', '', '25', '', 4, 1, 17837),
(19582, 45, 4023, 'Copying', '', 'Reproducing printed materials to hard copy, CD or other reproductive medium.', '', '10', '', 1, 1, 17834),
(19583, 45, 4023, 'Finishing', '', 'Binding, collating, stapling, etc. of printed documents or presentations.', '', '15', '', 2, 1, 17835),
(19584, 45, 4024, 'Property Services', '', 'Property services including searching deeds, titles, mortgages, and surveys documents, obtaining encumbrances and copies of documents, and searching for property owned by a particular person.', '', '30', '', 5, 1, 17842),
(19585, 45, 4024, 'Docket Maintenance', '', 'Implementing, maintaining or operating a computerized or manual docket event management system. Includes maintaining tickler files or calendars.', '', '15', '', 2, 1, 17839),
(19586, 45, 4024, 'Name or Entity Searches', '', 'Company or business name searching and registration (e.g., filing documents, forms, charges, provisional charges).', '', '20', '', 3, 1, 17840),
(19587, 45, 4024, 'Notary Services', '', 'Notarizing instruments such as transfers and agreements for the sale of real estate, documented gifts, insurance policies, mortgages and deeds, and certificates of service.', '', '25', '', 4, 1, 17841),
(19588, 45, 4024, 'Court Services', '', 'Court services including filing, requesting transcripts and litigation searching.', '', '10', '', 1, 1, 17838),
(19589, 45, 4025, 'Telecommunications Services', '', 'The coordination or management of phone calls, voice mail messages or conference calls.', '', '15', '', 2, 1, 17844),
(19590, 45, 4025, 'Facsimile Services', '', 'The coordination or management of facsimile (fax) services.', '', '20', '', 3, 1, 17845),
(19591, 45, 4025, 'Electronic Communications Services', '', 'The coordination or management of email, calendars, contact information, tasks, or similar communications activities utilizing systems such as Outlook or manual systems.', '', '10', '', 1, 1, 17843),
(19592, 45, 4026, 'Meeting Setup', '', 'Coordinating of setup and take-down of equipment, room arrangement, rental scheduling (delivery and pickup) and installation of decoration. Also includes the handling of meal/refreshment service items and food/beverage service.', '', '15', '', 2, 1, 17847),
(19593, 45, 4026, 'Meeting Support', '', 'Meeting support. Includes reception duties, meeting room management, personnel activities (technology support, hospitality, janitorial and/or greeter personnel), supplies management, and attendee request management (last minute requests for special items such as whiteboards, flipcharts, laser pointers, microphones, printouts, etc. not identified in Meeting Logistics or coordinated during Meeting Setup).', '', '20', '', 3, 1, 17848),
(19594, 45, 4026, 'Meeting Logistics', '', 'Selecting venues, identifying attendees, inviting/scheduling attendees, meeting RSVP tracking, budget determination, menu planning and caterer selection, decoration, booking/procurement and expense management, identification of support services needed and equipment required.', '', '10', '', 1, 1, 17846),
(19595, 45, 4027, 'Group Travel Management', '', 'The procurement of hotel room blocks, group airfare rates, rental vehicle pricing or other travel-related expenses.', '', '25', '', 4, 1, 17852),
(19596, 45, 4027, 'Travel Readiness Management', '', 'The coordination of travel-related pre-check programs (e.g. TSA PreCheck, Global Entry), management of passport and visa related services, management of travel-related insurance programs, oversight of interoffice travel information (e.g. temporary amenities, lodging, directions, office access, parking), and management of information related to foreign travel (e.g. immunization, identification requirements, customs, culture, currency, language, and translation services).', '', '30', '', 5, 1, 17853),
(19597, 45, 4027, 'Preferred Travel Vendor Management', '', 'The management of memberships in travel-related organizations (corporate housing vendors, extended-stay facilities, expatriate housing services, corporate time-share vendors, charter flight services, etc.). Management of the negotiation of rates at area hotels. Relationship management with outsourced travel agencies, travel services, and corporate travel brokers.', '', '20', '', 3, 1, 17851),
(19598, 45, 4027, 'Travel Planning', '', 'The coordination of travel arrangements such as hotel, airline, vehicle rental, airport ground transportation, car services, bus chartering, etc.', '', '10', '', 1, 1, 17849),
(19599, 45, 4027, 'Rewards Program Management', '', 'The establishment and maintenance of group travel reward programs (including business credit card reward points programs, corporate reward programs for hotels, airlines and vehicle rental companies, and coordination of benefits to redeem corporate rewards for administrative or other non-reimbursable travel).', '', '15', '', 2, 1, 17850),
(19600, 45, 4028, 'Environmental Stewardship and Sustainability', '', 'An environmentally sustainable organization seeking to participate within its community and seeking to balance economy, society and environment within its operations.', '', '30', '', 5, 1, 17858),
(19601, 45, 4028, 'Emergency Preparedness', '', 'Preparing for and responding to an unplanned event that can cause deaths or significant injuries to employees, customers or the public, or that can shut down your business, disrupt operations, cause physical or environmental damage, or threaten the facilityâ€™s financial standing or public image.', '', '25', '', 4, 1, 17857),
(19602, 45, 4028, 'Real Estate and Property Management', '', 'On-going communication, comprehensive marketing and advertising, thorough tenant screening and selection, full-service leasing, timely rent collection, regular inspections, cost-effective and reliable maintenance, strict and compliant evictions, and comprehensive accounting.', '', '20', '', 3, 1, 17856),
(19603, 45, 4028, 'Lease Administration', '', 'Acquiring, allocating, approving and managing lease space based on identified needs and in compliance with established guidelines to ensure efficient use of lease space.', '', '15', '', 2, 1, 17855),
(19604, 45, 4028, 'Operations and Maintenance', '', 'Assessing the condition of the facility and managing facility operations and maintenance activities.  It includes occupant services (parking, janitorial services, food services, concierge, facility helpdesk, security and safety), maintenance contracts, and operational planning requirements (temperature control, lighting, equipment replacement, etc.).', '', '10', '', 1, 1, 17854),
(19605, 45, 4029, 'Maintenance', '', 'Managing the maintenance contracting process.', '', '30', '', 5, 1, 17863),
(19606, 45, 4029, 'Operational Planning', '', 'Developing, recommending and managing the facilityâ€™s operational planning requirements (temperature control, lighting, equipment replacement, etc.).', '', '35', '', 6, 1, 17864),
(19607, 45, 4029, 'Occupant Services', '', 'Managing occupant services (parking, janitorial services, food services, concierge, facility helpdesk, security and safety).', '', '20', '', 3, 1, 17861),
(19608, 45, 4029, 'Safety and Security', '', 'Assuring enterprise and employee safety and security. Includes processes to prevent and/or mitigate loss, risk to or from personnel, threats to its physical assets, damage to its technology and intellectual property, and risks arising from all elements surrounding the work environment.', '', '25', '', 4, 1, 17862),
(19609, 45, 4029, 'Assess', '', 'Managing the assessment of building systems, structure, interiors, exteriors, and grounds condition.', '', '10', '', 1, 1, 17859),
(19610, 45, 4029, 'Operations', '', 'Managing the acquisition, installation, operation, maintenance and disposal of building systems, and structural, interior, exterior and grounds elements.  It includes maintaining relations with landlord/property manager regarding maintenance and related occupancy issues.', '', '15', '', 2, 1, 17860),
(19611, 45, 4030, 'Negotiations', '', 'Lease renewals and new leasing contracts including due diligence (physical, legal, financial) of potential properties.', '', '15', '', 2, 1, 17866),
(19612, 45, 4030, 'Lease/Portfolio Management', '', 'Property portfolio analysis, structure, category and distribution analysis, data management and comprehensive lease audits, lease expiry profiles and renewals negotiations, advise on premises consolidation, procurement of premises, lease negotiations, etc., and management of property disposal process.', '', '20', '', 3, 1, 17867),
(19613, 45, 4030, 'Research and Analysis', '', 'Detailed market and feasibility studies, key property trends research, demand and supply analyses, alternatives based on project viability, and other issues such as insurance claims, tenant analysis, market analysis, competition, etc.', '', '10', '', 1, 1, 17865),
(19614, 45, 4031, 'Improvement', '', 'Identifying when the preparedness program needs to be reviewed.  It includes discovering methods to evaluate the preparedness program and utilizing the review to make necessary changes and plan improvements.', '', '30', '', 5, 1, 17872),
(19615, 45, 4031, 'Implementation', '', 'Writing a preparedness plan addressing resource management, emergency response, crisis communications, business continuity, information technology, employee assistance, incident management, and training.', '', '20', '', 3, 1, 17870),
(19616, 45, 4031, 'Testing', '', 'Testing and evaluating a plan. Includes defining different types of exercises, learning how to conduct exercises, and using exercise results to evaluate the effectiveness of the plan.', '', '25', '', 4, 1, 17871),
(19617, 45, 4031, 'Planning', '', 'Gathering information about hazards and assess risks, conducting a business impact analysis (BIA), and examining ways to prevent hazards and reduce risks.', '', '15', '', 2, 1, 17869),
(19618, 45, 4031, 'Program Management', '', 'Organizing, developing and administering preparedness program and identifying regulations that establish minimum requirements.', '', '10', '', 1, 1, 17868),
(19619, 45, 4032, 'Delivery Services', '', 'Internal or external delivery or messenger runs (excluding court runs).', '', '10', '', 1, 1, 17873),
(19620, 45, 4032, 'Mail Processing and Review', '', 'Sorting, scanning, organizing or otherwise processing incoming and outgoing mail, packages or other shipments. It includes reviewing incoming mail, annotating with comments, associating with appropriate file, or other forms of pre-work or organization.', '', '15', '', 2, 1, 17874),
(19621, 45, 4033, 'Lobbying', 'Lobbying Support', 'Efforts to persuade members of the government to make decisions that would benefit a particular group or special interest.', 'Supporting efforts to persuade members of the government to make decisions that would benefit a particular group or special interest.', '20', '', 3, 1, 19143),
(19622, 45, 4033, 'Lobbying Administration', 'Lobbying Administration Support', 'Administration and oversite of lobbying afforts and related support activities.', 'Support of administration and oversite of lobbying afforts and related support activities.', '10', '', 1, 1, 17876),
(19623, 45, 4033, 'Lobbying Strategy', 'Lobbying Strategy Support', 'Defining and developing a plan to govern and direct lobbying efforts and related activities.', 'Support of efforts to define and develop a plan to govern and direct lobbying efforts and related activities.', '15', '', 2, 1, 17875),
(19624, 45, 4033, 'Lobbying Research', '', 'Monitoring, researching, and analyzing legislation or regulatory proposals and attending congressional hearings and other public meetings.', 'Supporting efforts to monitor, research, and analyze legislation or regulatory proposals and attending congressional hearings and other public meetings.', '25', '', 4, 1, 19144),
(19625, 45, 4034, 'Closing', '', 'The formal acceptance of the project and its conclusion. Administrative activities include the archiving of the files and documenting lessons learned. Includes completing, settling, and closing each contract (including the resolution of any open items) applicable to the project, and finalizing all activities across all of the process groups to formally close the project.', '', '30', '', 5, 1, 17881),
(19626, 45, 4034, 'Monitoring and Control', '', 'Observing project execution, identifying potential problems, taking corrective action, and controlling the execution of the project. Also includes measuring the ongoing project activities, monitoring the project variables (cost, effort, scope, etc.), and identifying corrective actions to address issues and risks.', '', '25', '', 4, 1, 17880),
(19627, 45, 4034, 'Execution', '', 'Completing the work defined in the project plan. Involves coordinating people and resources, performing the processes within the project plan, and producing deliverables. Also includes directing and managing project execution, assuring quality of deliverables, managing project team, distributing information, managing stakeholder expectations, conducting procurement, and testing deliverables against the initial design.', '', '20', '', 3, 1, 17879),
(19628, 45, 4034, 'Initiation', '', 'Determining the nature and scope of the project. Includes understanding the business environment and ensuring necessary controls are incorporated.', '', '10', '', 1, 1, 17877),
(19629, 45, 4034, 'Planning and Design', '', 'Planning time, cost and resources to estimate the work needed and to effectively manage risk during project execution. Includes developing the scope statement, selecting teams, identifying deliverables and activities, estimating resource requirements and time and cost for activities, developing the schedule and budget, risk planning, and gaining formal approval to begin work.', '', '15', '', 2, 1, 17878),
(19630, 45, 4035, 'Recovery Preparations', '', 'Preparations made to recover or restore critical and less critical business functions that fail for some reason.', '', '15', '', 2, 1, 17884),
(19631, 45, 4035, 'Contingency Planning', '', 'Developing a generalized capability and readiness to cope effectively with whatever major incidents and disasters occur, including those that were not, and perhaps could not have been, foreseen. Contingency preparations constitute a last-resort response if resilience and recovery arrangements should prove inadequate in practice.', '', '20', '', 3, 1, 17883),
(19632, 45, 4035, 'Resilience Design', '', 'The design and engineering of critical business functions and the supporting infrastructure in such a way that they are materially unaffected by most disruptions, for example through the use of redundancy and spare capacity.', '', '10', '', 1, 1, 17882),
(19633, 45, 4036, 'Compliance', '', 'Monitoring the contractual relationship, addressing related problems, incorporating necessary changes or modifications in the contract, ensuring both parties meet or exceed each other&#39;s expectations, and actively interacting with the supplier to achieve the contract&#39;s objective(s). Includes the &#34;transfer&#34; of requirements imposed on the organization by others.', '', '45', '', 8, 1, 17892),
(19634, 45, 4036, 'Management', '', 'Managing the supplier relationship and the delivery of services to meet the needs of the organization to keep costs stable and use resources effectively and efficiently.', '', '35', '', 6, 1, 17890),
(19635, 45, 4036, 'Performance', '', 'Establishing performance assessment criteria, analytics and monitoring of financial and operational performance.  It includes working with the supplier on SLA&#39;s (service level agreements) and KPI&#39;s (key performance indicators) to develop processes that enhance the capabilities of important suppliers to boost performance, direct supplier investment in new services, and assure accountability for performance in areas that drive the most value for the organization.', '', '40', '', 7, 1, 17891),
(19636, 45, 4036, 'Processes and Policies', '', 'Developing a common set of processes, policies, and tools governing the on-going day-to-day management of suppliers.  It includes the definition of roles and responsibilities for the various aspects of supplier management to bring the right skills and focus and to avoid redundant, non-value added activities.', '', '20', '', 3, 1, 17889),
(19637, 45, 4036, 'Selection', '', 'Defining supplier selection criteria, understanding the supplier lifecycle, and performing analysis of pre-engagement activities. Engaging procurement, legal, and risk management groups during the selection process.  It includes the due diligence process, supplier evaluation, and management of the RFI (request for information), ITT (Invitation to Tender), and RFP (request for proposal) processes to assure the creation of real accountability and incentives for suppliers to deliver business value.', '', '25', '', 4, 1, 17887),
(19638, 45, 4036, 'Business Case', '', 'Developing a well-structured argument that captures the reasoning for SRM (Supplier Relationship Management) implementation that focuses on the organizations most pressing supplier management pain-points and challenges, determining the viability of engaging a service provider versus internal resources, and recognizing the value of applying SRM best practices.', '', '15', '', 2, 1, 17888),
(19639, 45, 4036, 'Contracts and Agreement', '', 'Developing contractual agreements through the negotiation process to achieve mutually acceptable terms and conditions.', '', '30', '', 5, 1, 17886),
(19640, 45, 4036, 'Strategy', '', 'Defining the long-term strategy and vision for SRM (Supplier Relationship Management) and developing a common understanding of the scope of needed SRM practices including portfolio planning and management and supplier lifecycle concept.  Identifying which suppliers are strategic, which are the non-strategic suppliers, and how those groups should be managed differently to assure strategic suppliers are delivering strategic value.', '', '10', '', 1, 1, 17885),
(19641, 45, 4037, 'Open Item Management', '', 'Monitoring and analyzing transactions to prompt predetermined actions at a specific time or if predetermined criteria exist.', '', '60', '', 11, 1, 17903),
(19642, 45, 4037, 'Process Management', '', 'The application of knowledge, skills, tools, techniques and systems to define, visualize, measure, control, report and improve processes with the goal to meet customer requirements profitably.', '', '55', '', 10, 1, 17902),
(19643, 45, 4037, 'Key Performance Indicators', '', 'A type of measurement known as a performance indicator or key performance indicator (KPI).', '', '45', '', 8, 1, 17900),
(19644, 45, 4037, 'Version Control', '', 'Managing changes to documents, computer programs, web sites, and other collections of information (also known as revision control or source control).', '', '50', '', 9, 1, 17901),
(19645, 45, 4037, 'Statistical Inference', '', 'Deducing properties of an underlying distribution of data.', '', '35', '', 6, 1, 17898),
(19646, 45, 4037, 'Probabilistic Simulation', '', 'Explicitly representing uncertainties by specifying inputs as probability distributions to quantitatively represent uncertainties in simulations.', '', '40', '', 7, 1, 17899);
INSERT INTO `tblQuestion` (`question_id`, `survey_id`, `page_id`, `question_desc`, `question_desc_alt`, `question_extra`, `question_extra_alt`, `question_code`, `question_UTBMS`, `question_seq`, `question_enabled`, `question_id_original`) VALUES
(19647, 45, 4037, 'Group Consolidation, Budgeting and Forecasts', '', 'The consolidation and centralization of financial information, documenting how the overall plan will be executed month to month, specifying expenditures, and using accumulated historical data to predict financial outcomes for future months or years.', '', '30', '', 5, 1, 17897),
(19648, 45, 4037, 'Real-time Reporting and Alerts', '', 'Delivering business intelligence (BI) or information about business operations as they occur (also known as real-time business intelligence (RTBI)).', '', '20', '', 3, 1, 17895),
(19649, 45, 4037, 'Unstructured Data Sources', '', 'The interfacing with data that cannot be stored in predictably ordered columns and rows; irregularly or randomly repeated column patterns that vary from row to row; or the knowledge that business users have about future business trends.', '', '25', '', 4, 1, 17896),
(19650, 45, 4037, 'Multidimensional Aggregation and Allocation', '', 'The processing of data from many different data sources in a resource (computer memory) efficient way.', '', '10', '', 1, 1, 17893),
(19651, 45, 4037, 'Denormalization, Tagging and Standardization', '', 'The application of various methods of data enhancement and manipulation to facilitate queries and improve search and analytical performance.', '', '15', '', 2, 1, 17894),
(19652, 45, 4038, 'Closing', '', 'The formal acceptance of the project and its conclusion. Administrative activities include the archiving of the files and documenting lessons learned. Includes completing, settling, and closing each contract (including the resolution of any open items) applicable to the project, and finalizing all activities across all of the process groups to formally close the project.', '', '30', '', 5, 1, 17908),
(19653, 45, 4038, 'Monitoring and Control', '', 'Observing project execution, identifying potential problems, taking corrective action, and controlling the execution of the project. Also includes measuring the ongoing project activities, monitoring the project variables (cost, effort, scope, etc.), and identifying corrective actions to address issues and risks.', '', '25', '', 4, 1, 17907),
(19654, 45, 4038, 'Execution', '', 'Completing work defined in the project plan. Involves coordinating people and resources, performing the processes within the project plan, and producing deliverables. Also includes directing and managing project execution, assuring quality of deliverables, managing project team, distributing information, managing stakeholder expectations, conducting procurement, and testing deliverables against the initial design.', '', '20', '', 3, 1, 17906),
(19655, 45, 4038, 'Initiation', '', 'Determining the nature and scope of the project. Includes understanding the business environment and ensuring necessary controls are incorporated.', '', '10', '', 1, 1, 17904),
(19656, 45, 4038, 'Planning and Design', '', 'Planning time, cost and resources adequately to estimate the work needed and effectively managing risk during project execution. Includes developing the scope statement, selecting teams, identifying deliverables and activities, estimating resource requirements, time and cost for activities, developing the schedule and budget, risk planning, and gaining formal approval to begin work.', '', '15', '', 2, 1, 17905),
(19657, 45, 4039, 'Audit', '', 'Auditing and documenting compliance with codes, regulations, policies and standards.', '', '25', '', 4, 1, 17912),
(19658, 45, 4039, 'Measure', '', 'Measuring the quality of services provided by collecting, verifying, analyzing and reporting data from various sources (i.e. performance metrics, customer satisfaction, feedback mechanisms).', '', '15', '', 2, 1, 17910),
(19659, 45, 4039, 'Assess', '', 'Assessing ways to improve workplace productivity and developing and implementing process improvements.', '', '20', '', 3, 1, 17911),
(19660, 45, 4039, 'Develop', '', 'Developing and managing the creation and application of standards (benchmarking, measuring observable behaviors, service response, resolution times and so forth).', '', '10', '', 1, 1, 17909),
(19661, 45, 4042, 'Managing Expectations', '', 'Clearly defining the scope of work and the delivery expectations in order to assure client expectations are satisfied.', '', '10', '', 1, 1, 19125),
(19662, 45, 4042, 'Resource Management', '', 'Assigning and monitoring resources and personnel adequate to assure client expectations are met and business outcomes are achieved.', '', '15', '', 2, 1, 19126),
(19663, 45, 4042, 'Terms of Service', '', 'Assuring both the clients, and the organizations, service and quality requirements are established, monitored and maintained.', '', '20', '', 3, 1, 19127),
(19664, 45, 4042, 'Client Feedback', '', 'Obtaining the &#34;voice of the client&#34; utlizing various means (surveys, interviews, assessments, etc.) to assure complete satisaction for the services provided and that issues are properly identified and appropriately remedied.', '', '25', '', 4, 1, 19128),
(19665, 45, 4043, 'Sales Forecasting', '', 'The process of estimating future sales to enable informed business decisions and predict short-term and long-term performance. Forecasts can be based on past sales data, industry-wide comparisons, and economic trends.', '', '15', '', 2, 1, 19131),
(19666, 45, 4043, 'Interpersonal Relations', '', 'The interpersonal interaction (one-on-one meetings, telephone calls, networking, etc.) that you engage in with prospects and customers to promote collective or individual abilities, educate regarding specific services being offered or sought, and obtain commitments (closing) to acquire said services.', '', '20', '', 3, 1, 19132),
(19667, 45, 4043, 'Sales Strategy', '', 'A plan on how to go about selling products and services and increasing profits. Sales strategies identify â€œpitches,â€ or key points to address when speaking with potential consumers.', '', '10', '', 1, 1, 19130),
(19668, 45, 4043, 'Public (Community) Relations', '', 'Managing the spread of information between an individual or an organization and the public, generally at no cost, to inform the public, prospective customers, investors, partners, employees and other stakeholders and ultimately persuade them to maintain a certain view about the organization, its leadership, products, or decisions.', '', '25', '', 4, 1, 19133),
(19669, 45, 4043, 'Media Relations and Strategy', '', 'Linkages with the media personalities and resources that facilitate an organization receiving favorable, timely, and widespread editorial coverage. Use of appropriate media mix to achieve optimum results from an advertising campaign.  It includes assessing value or return on investment (ROI) from advertising.', '', '30', '', 5, 1, 19134),
(19670, 45, 4043, 'Proposals', '', 'The development of responses to panel opportunities, request for proposals (RFPs) or tenders, formal proposals, pitch books or similar documents used to generate new business opportunities.', '', '35', '', 6, 1, 19135),
(19671, 45, 4044, 'Qualification', '', 'Determining the quality and appropriateness of the organization seeking the business opportunity.  Alignment with strategic and financial objections are often among considerations.', '', '10', '', 1, 1, 19136),
(19672, 45, 4044, 'Development', '', 'The collection of required information and producing the proposal or response in the required format.', '', '15', '', 2, 1, 19137),
(19673, 45, 4044, 'Post-mortems', '', 'The review and analysis of results from proposal efforts to learn more about the client&#39;s specific needs/wants -- or why the work would not have been awarded to your firm and might never be.', '', '20', '', 3, 1, 19138),
(19674, 45, 4045, 'Content Strategy', '', 'Developing and the strategy governing the development and distribution of messages or statements to the public.', '', '10', '', 1, 1, 19140),
(19675, 45, 4045, 'Content Development', '', 'Development of marketing or promotional materials, content and messages.', '', '15', '', 2, 1, 19141),
(19676, 45, 4045, 'Content Distribution', '', 'Communicating or making available a message or statement to the public by any means such as print, radio, television, internet, etc.', '', '20', '', 3, 1, 19142),
(19158, 45, 3942, 'Trial Preparation and Trial', '', 'Preparing for or participation in a judicial examination and determination of facts and legal issues arising between parties to a civil or criminal action.', '', '30', 'L400', 5, 1, 17384),
(19159, 45, 3942, 'Appeal', '', 'Timely resorts by an unsuccessful party in a lawsuit or administrative proceeding to an appropriate superior court empowered to review a final decision on the ground that it was based upon an erroneous application of law.', '', '35', 'L500', 6, 1, 17382),
(19160, 45, 3942, 'Exemplar and Exhibit Disposition', '', 'The retention, storage and proper disposition of property and exemplars (models).', '', '40', '', 7, 1, 17381),
(19161, 45, 3942, 'eDiscovery', 'eDiscovery', 'Discovery in litigation or government investigations which deals with the exchange of information in electronic format (often referred to as electronically stored information or ESI). This data is subject to local rules and agreed-upon processes, and are often reviewed for privilege and relevance before being turned over to opposing counsel.', 'Discovery in litigation or government investigations which deals with the exchange of information in electronic format (often referred to as electronically stored information or ESI). This data is subject to local rules and agreed-upon processes, and are often reviewed for privilege and relevance before being turned over to opposing counsel.', '25', '', 4, 1, 17380),
(19162, 45, 3943, 'Analysis/Strategy', '', 'Thinking, strategizing, and planning for a case. It includes discussions, writings, and meetings on case strategy, preparing litigation plan, and communicating on case strategy.', '', '20', 'L120', 3, 1, 17392),
(19163, 45, 3943, 'Settlement/Non-Binding ADR', '', 'Settlement. Includes planning and participating in settlement discussions and conferences, implementing settlement, pursuing mediation, travel to/from mediation and attending mediation. Also includes pre-litigation demand letters and communications regarding settlement, mediation, or alternative dispute resolution (ADR).', '', '40', 'L160', 7, 1, 17393),
(19164, 45, 3943, 'Property and Exemplars', '', 'Collecting, handling and storing property and exemplars (models or exhibits). It includes lifecycle management, procurement, storage, tracking location, and managing case billing information.', '', '15', '', 2, 1, 17391),
(19165, 45, 3943, 'Fact Investigation/Development', '', 'Investigating or understanding the facts of matter. It includes interviewing involved personnel/potential witnesses, reviewing documents, working with investigators, legal research for initial case assessment purposes, and communications for fact investigation.', '', '10', 'L110', 1, 1, 17390),
(19166, 45, 3943, 'Document/File Management', '', 'File organization and administration for database construction and management.', '', '30', 'L140', 5, 1, 17388),
(19167, 45, 3943, 'Experts/Consultants', '', 'Researching, interviewing, and working with experts and consultants. It includes developing expert and consultant reports and communicating with experts and consultants.', '', '25', 'L130', 4, 1, 17389),
(19168, 45, 3943, 'Budgeting', '', 'Developing and editing correspondence for regarding matter budget.', '', '35', 'L150', 6, 1, 17387),
(19169, 45, 3944, 'Pleadings', '', 'Drafting and editing pleadings. It includes reviewing and answering complaints, counter-claims, and third party complaints, motions to dismiss or strike jurisdictional motions, and research for pleadings.', '', '10', 'L210', 1, 1, 17398),
(19170, 45, 3944, 'Class Action Certification and Notice', '', 'Proceedings unique to class action litigation and derivative suits such as class certification and notice.', '', '35', 'L260', 6, 1, 17399),
(19171, 45, 3944, 'Preliminary Injunctions/Provisional Remedies', '', 'Developing and discussing strategy for remedies, preparing motions, affidavits, and briefs, reviewing opponent&#39;s papers, preparing for, travel to/from and attending court hearing, preparing witnesses for the hearing, effectuating the remedy, and research for preliminary injunctions and provisional remedies.', '', '15', 'L220', 2, 1, 17397),
(19172, 45, 3944, 'Other Written Motions/Submissions', '', 'Developing all motions other than dispositive, pleadings, and discovery, responding to all motions other than dispositive, pleadings, and discovery, arguing all motions other than dispositive, pleadings, and discovery, and research for other written motions and submissions.', '', '30', 'L250', 5, 1, 17396),
(19173, 45, 3944, 'Dispositive Motions', '', 'Developing strategy and legal research for dispositive motions and motions for complete or partial summary judgment, preparing affidavits, reviewing opponent&#39;s pleadings and defensive motions, preparing for, travel to/from and attending hearing.', '', '25', 'L240', 4, 1, 17395),
(19174, 45, 3944, 'Court Mandated Conferences', '', 'Preparing for hearing required by court order or procedural rules. It includes travel to/from court ordered conferences and attending hearings required by court order or procedural rules.', '', '20', 'L230', 3, 1, 17394),
(19175, 45, 3945, 'Discovery On-Site Inspections', '', 'Attending and travel to/from site inspections.', '', '35', 'L360', 6, 1, 17405),
(19176, 45, 3945, 'Discovery Motions', '', 'Developing and responding to or arguing motions that arise from discovery protective order process.', '', '30', 'L350', 5, 1, 17404),
(19177, 45, 3945, 'Depositions', '', 'Preparing deposition notices and subpoenas, communicating with opposing and other party&#39;s counsel on scheduling and logistics, planning and preparing to take the deposition, discussing deposition strategy, preparing witnesses, reviewing documents for deposition preparation, travel to/from and attending depositions, and drafting deposition summaries.', '', '20', 'L330', 3, 1, 17403),
(19178, 45, 3945, 'Expert Discovery', '', 'Preparing expert discovery notices, communicating with expert on scheduling and logistics, discussing expert strategy, preparation and consultation with expert, reviewing expert documents, records, or films, and drafting expert summaries and independent medical examinations (IMEs).', '', '25', 'L340', 4, 1, 17402),
(19179, 45, 3945, 'Document Production', '', 'Developing, responding, objecting to, and negotiating document request. Includes identifying and reviewing documents for production, identifying and reviewing documents for privilege, preparing and drafting request to produce, preparing and drafting response for request to produce, preparing and drafting notice of non-party production (NNP), preparing and drafting subpoena and authorization, obtaining non-subpoenaed documents (i.e. tax returns, work comp, disability, court files), and reviewing summarizing subpoenaed documents.', '', '15', 'L320', 2, 1, 17401),
(19248, 45, 3955, 'Official Communication - Domestic', '', 'Processing an Official Communication from a Patent Office (known as an \"Office Action\" in the U.S. when directed toward the merits of the application) in the home country of an application, including initial review and any calendaring (\"docketing\" in the U.S.) of any response deadline, report to client with any proposed response, review of applicant&rsquo;s instructions and inventor&rsquo;s comments, preparation of amendments and/or responsive arguments, examiner interviews, and reporting to the client.', '', '20', 'PA430', 3, 1, 17501),
(19247, 45, 3954, 'Other Patent Application Preparation - Domestic', '', 'Patent application preparation for applications that are to be filed in the (\"domestic\") home country or region of the applicant, and that cannot be included under another category.', '', '40', 'PA399', 7, 1, 17492),
(19246, 45, 3954, 'Validation Patent Application', '', 'Preparing and filing applications for validation of an issued regional patent in the (&rsquo;domestic&rsquo;) home country of the applicant.', '', '35', 'PA360', 6, 1, 17491),
(19184, 45, 3946, 'Trial and Hearing Attendance', '', 'Appearing at trial, trial-related hearings, and court-mandated conferences, travel to/from hearings and conferences, and communication regarding trial progression.', '', '30', 'L450', 5, 1, 17410),
(19185, 45, 3946, 'Expert Witnesses', '', 'Preparing for examination of expert witness and preparing for cross examination of expert witness.', '', '15', 'L420', 2, 1, 17407),
(19186, 45, 3946, 'Written Motions/Submissions', '', 'Developing written motions during prep for trial and trial, preparing for motions in limine, preparing and reviewing jury instructions, responding to written motions during prep for trial and trial, and arguing written motions during prep for trial and trial. Also includes developing and reviewing written pre-trial and trial filings, witness lists, proposed findings of fact, conclusions of law, and trial briefs.', '', '20', 'L430', 3, 1, 17408),
(19187, 45, 3946, 'Fact Witnesses', '', 'Preparing for examination of non-expert witness and preparing for cross-examination of non-expert witness.', '', '10', 'L410', 1, 1, 17406),
(19188, 45, 3947, 'Appellate Briefs', '', 'Researching and preparing appellate briefs, reviewing opposing party appellate brief, and reviewing record.', '', '15', 'L520', 2, 1, 17414),
(19189, 45, 3947, 'Oral Argument', '', 'Preparing for oral argument, travel to/from and arguing an appeal, communicating with client or opposing counsel or co-counsel, and preparing appellate record.', '', '20', 'L530', 3, 1, 17415),
(19190, 45, 3947, 'Appellate Proceedings/Motions Practice', '', 'Researching appellate issues, preparing and reviewing motions or other filings, drafting response to motions or other filings, arguing motions or other filings, travel to/from and attending motion hearings, preparing notice of appeal, designating appellate record, reviewing responses to appellate petition, preparing responses to appellate petition, and preparing petition appendix.', '', '10', 'L510', 1, 1, 17413),
(19191, 45, 3948, 'EDRM Project Management', '', 'Supervising or managing specific activities or actions throughout the EDRM (Electronic Discovery Reference Model) continuum such as conducting meetings and team calls, developing work plans, budgets, forecasts, reports and other meaningful activities or for general project management.', '', '50', 'L690', 9, 1, 17424),
(19192, 45, 3948, 'Production', '', 'Turning over documents to opposing counsel based on agreed-upon specifications.', '', '40', 'L670', 7, 1, 17422),
(19193, 45, 3948, 'Presentation', '', 'Preparing and displaying ESI before audiences (at depositions, hearings, trials, etc.), especially in native & near-native forms, to elicit further information, validate existing facts or positions, or persuade an audience.', '', '45', 'L680', 8, 1, 17423),
(19194, 45, 3948, 'Analysis', '', 'Actions required by litigation teams that ensure ability to make informed decisions about strategy and scope through reliable methods based on verified data.', '', '35', 'L660', 6, 1, 17421),
(19195, 45, 3948, 'Processing', '', 'Preparing native files to be loaded into a document review platform. Often, this involves the extraction of text and metadata from the native files.', '', '25', 'L630', 4, 1, 17419),
(19196, 45, 3948, 'Review', '', 'Reviewing documents for responsiveness to discovery requests and for privilege.', '', '30', 'L650', 5, 1, 17420),
(19197, 45, 3948, 'Collection', '', 'Collecting and transferring data from a company to their legal counsel, who will determine relevance and disposition of data.', '', '20', 'L620', 3, 1, 17418),
(19198, 45, 3948, 'Identification', '', 'The identification of potentially responsive documents for further analysis and review.', '', '10', 'L600', 1, 1, 17416),
(19199, 45, 3948, 'Preservation', '', 'Identifying potentially relevant documents and placing them in a legal hold. This ensures that data cannot be destroyed. Care is taken to ensure this process is defensible, while the end-goal is to reduce the possibility of data spoliation or destruction.', '', '15', 'L610', 2, 1, 17417),
(19200, 45, 3949, 'Integration Matters (M&#38;A)', '', 'Post-closing integration matters, including restructuring of subsidiaries and post-closing transfer of assets and liabilities within a party&#39;s corporate structure.', '', '55', 'MJ00', 10, 1, 17460),
(19201, 45, 3949, 'Post-Closing Requirements, Disputes &#38; Adjustments', '', 'Post-closing requirements, disputes and adjustments (working capital, indemnification, earn-out), post-closing working capital, purchase price adjustments, earn-out and other adjustments, and negotiating and litigating indemnification claims.', '', '60', 'MK00', 11, 1, 17461),
(19202, 45, 3949, 'Closing Matters', '', 'Drafting and negotiating closing documents (e.g., certificates, bills of sale, legal opinions, closing agenda, powers of attorney, etc.) and attending the closing.', '', '50', 'MI00', 9, 1, 17459),
(19203, 45, 3949, 'Shareholder/Board Matters', '', 'Board presentations regarding due diligence findings and the transaction, drafting of minutes and resolutions of the board, review of fairness opinions, and advising the board regarding fiduciary duties/shareholder meetings.', '', '45', 'MH00', 8, 1, 17458),
(19204, 45, 3949, 'Financing', '', 'Drafting, negotiating and amending any sale or acquisition financing (e.g., bank loans, debentures, equity financing, security agreements, guarantees, etc.).', '', '35', 'MF00', 6, 1, 17456),
(19205, 45, 3949, 'Regulatory and Specialty Matters', '', 'Consultations regarding particular areas of expertise.', '', '40', 'MG00', 7, 1, 17457),
(19206, 45, 3949, 'Negotiation/Revision/Response', '', 'Negotiating and amending initial transaction documentation as a result of such negotiations, drafting ancillary agreements, attendance at meetings, and associated responses.', '', '30', 'ME00', 5, 1, 17454),
(19207, 45, 3949, 'Maintenance and Renewal', '', 'Subsequent maintenance and renewal requirements under the terms of the transaction or project such as monitoring of lease agreements, routine waivers and coordination of lien perfection (UCC and other) requirements.', '', '65', '', 12, 1, 17455),
(19208, 45, 3949, 'Due Diligence and Disclosure Schedules', '', 'Reviewing documents, attending management presentations, preparing due diligence questionnaire, setting up data room, negotiating due diligence reliance letters, and conducting other due diligence searches (e.g., liens, litigation, background checks, etc.).  It includes time related to drafting, reviewing and negotiating disclosure schedules.', '', '25', 'MD00', 4, 1, 17453),
(19209, 45, 3949, 'Initial Document Preparation', '', 'Drafting transaction documents and opinions prior to delivery, and soliciting input/guidance from specialists on terms and provisions.  Includes all related communications regarding engagement.', '', '20', 'MC00', 3, 1, 17452),
(19210, 45, 3949, 'Preliminary Matters', '', 'Preliminary matters (letter of intent, confidentiality agreements, exclusivity, inducement, break fee information memorandum, auction process, service provider engagement agreements). Includes drafting, negotiating and amending preliminary stage agreements, establishing bidding and auction procedures, and drafting, negotiating and amending engagement agreements with service providers (e.g., accountants, environmental consultants, investment bankers, etc.).', '', '15', 'MB00', 2, 1, 17451),
(19211, 45, 3949, 'Deal Management', '', 'Managing project activities not clerical in nature, i.e., time spent overseeing the management of the matter based on assuring that scope, time and cost are evaluated, monitored and communicated. Includes adjusting the level of effort and assignment of work, communicating among the team and with the client/customer on changes in circumstances and evaluation of budget against actual.', '', '10', 'MA00', 1, 1, 17450),
(19212, 45, 3950, 'Real Property', '', 'Real property due diligence. It includes drafting, negotiating and amending real property transfer documents, assigning leases, landlord consents, land use regulations.', '', '40', 'MG70', 7, 1, 17468),
(19213, 45, 3950, 'Securities Regulatory Matters', '', 'Drafting and filing any required registration statements, proxy statements and Reports/Circulars, and no action requests.', '', '45', 'MG80', 8, 1, 17469),
(19214, 45, 3950, 'Tax', '', 'Transaction structuring. It includes tax due diligence, negotiation of tax allocations, and indemnifications and representations.', '', '50', 'MG90', 9, 1, 17470),
(19215, 45, 3950, 'Environmental', '', 'Environmental due diligence, transfer of environmental permits, and other environmental matters.', '', '30', 'MG40', 5, 1, 17466),
(19216, 45, 3950, 'Intellectual Property and Technology', '', 'Intellectual property and technology due diligence. It includes drafting, negotiating and amending licenses of intellectual property and technology assets', '', '35', 'MG50', 6, 1, 17467),
(19217, 45, 3950, 'Employment, Labor and Employee Benefits', '', 'The analysis of human resource issues (excluding Executive Compensation) in an acquisition (e.g., WARN Act requirements, relative pay scales and practices, title mapping, etc.), employee benefit issues (e.g., 401(k) mergers, health and welfare plan analysis and harmonization, leave policy issues), trade union and works council matters (e.g., notices or consultations, renegotiation of union contracts, etc.), and immigration matters.', '', '20', 'MG30', 3, 1, 17464),
(19218, 45, 3950, 'Executive Compensation', 'Executive Compensation', 'The analysis of employment agreements, severance arrangements, equity award plans and agreements, change-in-control payments, retention or &#34;Stay agreements&#34; and nonqualified deferred compensation arrangements and other incentive compensation arrangements. Preparation of &#34;golden parachute&#34; (Section 280G) vote materials, if applicable. Consideration of post-acquisition executive benefits to be provided to senior management.', 'The analysis of employment agreements, severance arrangements, equity award plans and agreements, change-in-control payments, retention or &#34;Stay&#34; agreements and nonqualified deferred compensation arrangements and other incentive compensation arrangements. Preparation of &#34;golden parachute&#34; (Section 280G) vote materials, if applicable. Consideration of post-acquisition executive benefits to be provided to senior management.', '25', 'MG31', 4, 1, 17465),
(19219, 45, 3950, 'Antitrust / Competition', '', 'Analyzing filing requirements and possible antitrust overlaps, preparing competition law filings, responding to information requests from regulators, meetings and negotiations with regulators, and implementing any regulatory required actions (e.g., hold separate commitments, asset dispositions).', '', '10', 'MG10', 1, 1, 17462),
(19220, 45, 3950, 'Data Security/Privacy/Data Protection/Cyber Security', '', 'Data security, privacy, and cybersecurity due diligence. It includes assessment of risks and maturity of security systems, tactical and strategic fixes to improve security and their related costs, potential or actual data breaches, system vulnerabilities, overall security posture, potential liabilities, and impact on valuations.', '', '15', 'MG20', 2, 1, 17463),
(19221, 45, 3951, 'International Patent Preparation', '', 'Provisional, non-provisional, and design application preparation, plant and validation patent and continuing application preparation for international patents.', '', '30', 'PA500', 5, 1, 17475),
(19222, 45, 3951, 'International Patent Prosecution', '', 'Information disclosure, preliminary amendment, official communication, quasi-judicial administrative proceedings, post-issuance remedial action, and other patent prosecution activities for international patents.', '', '35', 'PA600', 6, 1, 17476),
(19223, 45, 3951, 'Other Patent-Related Tasks', '', 'Opinion preparation, portfolio analysis and management, assignments and security interests, and licensing.', '', '40', 'PA700', 7, 1, 17477),
(19224, 45, 3951, 'Domestic Patent Preparation', '', 'Provisional, non-provisional, and design application preparation, plant and validation patent and continuing application preparation for domestic patents.', '', '20', 'PA300', 3, 1, 17473),
(19225, 45, 3951, 'Domestic Patent Prosecution', '', 'Information disclosure, preliminary amendment, official communication, quasi-judicial administrative proceedings, post-issuance remedial action, and other patent prosecution activities for domestic patents.', '', '25', 'PA400', 4, 1, 17474),
(19226, 45, 3951, 'Assessment, Development, and Administration', '', 'Fact investigation and development, analysis and strategy, document and file management, and budgeting.', '', '10', 'PA100', 1, 1, 17471),
(19227, 45, 3951, 'Patent Investigation and Analysis', '', 'The state-of-the-art, patentability, clearance, validity, infringement, and status investigations, and publication watches.', '', '15', 'PA200', 2, 1, 17472),
(19228, 45, 3952, 'Budgeting', '', 'Developing, negotiating, and revising the budget for a matter.', '', '25', 'PA140', 4, 1, 17481),
(19229, 45, 3952, 'Other Assessment, Development, or Administration', '', 'The assessment, development, administration and other activities that cannot be included under another category.', '', '30', 'PA199', 5, 1, 17482),
(19230, 45, 3952, 'Analysis/Strategy', '', 'Thinking, strategizing, and planning for a case. Includes discussions, writing, and meetings on case strategy. Also includes initial legal research for case assessment purposes and legal research for developing a basic case strategy.', '', '15', 'PA120', 2, 1, 17479),
(19231, 45, 3952, 'Document/File Management', '', 'Creating and populating document and other databases or filing systems. Includes the planning, design, and overall management of this process.', '', '20', 'PA130', 3, 1, 17480),
(19232, 45, 3952, 'Fact Investigation and Development', '', 'Investigating and understanding the facts of a matter. Includes interviewing of involved personnel and potential witnesses, reviewing documents to learn the facts of a potential case, working with an investigator, and all related communications and correspondence.', '', '10', 'PA110', 1, 1, 17478),
(19233, 45, 3953, 'Other Patent Investigation and Analysis', '', 'Patent investigation and analysis activities that cannot be included under another category.', '', '45', 'PA299', 8, 1, 17490),
(19234, 45, 3953, 'Infringement Investigation', '', 'Determining which of a client&rsquo;s patent claims may cover a non-client&rsquo;s products or processes, including collecting patent and/or product information, obtaining any product samples, comparing the products to the client&rsquo;s patent claims, and reporting to the client.', '', '35', 'PA260', 6, 1, 17488),
(19235, 45, 3953, 'Status Investigation', '', 'Determining the status of a published or unpublished patent application, or issued patent, including application and/or database review and forwarding report to client.', '', '40', 'PA270', 7, 1, 17489),
(19236, 45, 3953, 'Validity Investigation', '', 'Determining whether a patent claim is invalid, including defining of the scope and field of search, searching, analyzing search results, and reporting to the client.', '', '25', 'PA240', 4, 1, 17486),
(19237, 45, 3953, 'Publication Watches', '', 'Planning, completing, and reporting the results of periodic searches for new publications in connection with a specific assignee, area of technology, patent application, or issued patent.', '', '30', 'PA250', 5, 1, 17487),
(19238, 45, 3953, 'Clearance Investigation', '', 'Determining whether a proposed product or process might be covered by the claims of patents and/or published patent applications, including definition of the scope and field of the search, searching, search field integrity checking, analysis of search results, and reporting to client.', '', '20', 'PA230', 3, 1, 17485),
(19239, 45, 3953, 'State-of-the-Art Investigation', '', 'Determining the state of the art in a particular area of technology, including definition of the scope and field of the search, searching, analysis of search results, and reporting to client.', '', '10', 'PA210', 1, 1, 17483),
(19240, 45, 3953, 'Patentability Investigation', '', 'Determining the approximate scope of patent protection that may be available for an invention, including definition of the scope and field of the search, searching, analysis of search results, and reporting to client.', '', '15', 'PA220', 2, 1, 17484),
(19241, 45, 3954, 'Provisional Application Preparation - Domestic', '', 'Completing a provisional patent application that is to be filed in the (\"domestic\") home country or region of the applicant, including review of invention disclosure materials and prior art, interviews with the inventors, drafting and revision of application, preparation and execution of formal documentation (such as assignments, transmittals, and biological deposits), filing of application, and reporting to the client.', '', '10', 'PA310', 1, 1, 17497),
(19242, 45, 3954, 'Continuing Application Preparation - Domestic', '', 'Completing a continuing patent application (claiming priority to an earlier-filed, parent application in the same country, without adding any new disclosure) that are to be filed in the (\"domestic\") home country or region of the applicant, including review of parent application, drafting and execution of any formal documents (such as transmittals and information disclosure statements), filing of application, and reporting to the client.', '', '30', 'PA350', 5, 1, 17495),
(19243, 45, 3954, 'Non-Provisional Application Preparation - Domestic', '', 'Completing a non-provisional utility or utility model (but not design or provisional) patent application that are to be filed in the (\"domestic\") home country or region of the applicant, including review of invention disclosure materials and prior art, interviews with the inventors, drafting and revision of application, preparation and execution of formal documents (such as assignments, declarations, information disclosure statements, transmittals, and biological deposits) filing of application, and reporting to the client. Includes preparation of PCT, European and other regional applications when filed in the home country of the applicant.', '', '15', 'PA320', 2, 1, 17496),
(19244, 45, 3954, 'Plant Patent Preparation - Domestic', '', 'Completing plant patent applications that are to be filed in the (\"domestic\") home country or region of the applicant, including review of invention disclosure materials and prior art, interviews with the inventors, drafting and revision of application, preparation and execution of formal documents (such as assignments, declarations, information disclosure statements and transmittals, and biological deposits) filing of application, and reporting to the client.', '', '25', 'PA340', 4, 1, 17494),
(19245, 45, 3954, 'Design Application Preparation- Domestic', 'Design Application Preparation - Domestic', 'Completing a design patent (but not utility or utility model) application or design registration application that are to be filed in the (\"domestic\") home country or region of the applicant, including review of invention disclosure materials and prior art, interviews with the inventors, drafting and revision of application, preparation and execution of formal documents (such as assignments, declarations, information disclosure statements, and transmittals) filing of application, and reporting to the client.', 'Completing a design patent (but not utility or utility model) application or design registration application that are to be filed in the (\"domestic\") home country or region of the applicant, including review of invention disclosure materials and prior art, interviews with the inventors, drafting and revision of application, preparation and execution of formal documents (such as assignments, declarations, information disclosure statements, and transmittals) filing of application, and reporting to the client.', '20', 'PA330', 3, 1, 17493),
(19251, 45, 3955, 'Information Disclosure Statement - Domestic', '', 'Bringing prior art, or other information, to the attention of an Examiner in the home country of the applicant.', '', '10', 'PA410', 1, 1, 17499),
(19249, 45, 3955, 'Other Patent Prosecution - Domestic', '', 'Applications that are to be initially filed in the (\"domestic\") home country or region of the applicant, and that cannot be included under another category.', '', '35', 'PA499', 6, 1, 17502),
(19250, 45, 3955, 'Post-Issuance Remedial Action- Domestic', 'Post-Issuance Remedial Action - Domestic', 'Completing activities in connection with any necessary remedial action, after issuance of a patent in the (&rsquo;domestic&rsquo;) home country of the applicant, such as the filing of a Certificate of Correction, and correcting patent term in view of patent term adjustment (mis)calculation in the U.S.', 'Completing activities in connection with any necessary remedial action, after issuance of a patent in the (&rsquo;domestic&rsquo;) home country of the applicant, such as the filing of a Certificate of Correction, and correcting patent term in view of patent term adjustment (mis)calculation in the U.S.', '30', 'PA450', 5, 1, 17503),
(19252, 45, 3955, 'Preliminary Amendment - Domestic', '', 'Revising an application prior to the examination of the application on its merits in the home country of the applicant, including preparation of amendments and revised drawings that do not affect the scope of the disclosure.', '', '15', 'PA420', 2, 1, 17500),
(19253, 45, 3955, 'Quasi-Judicial Administrative Proceedings - Domestic', '', 'Completing a quasi-judicial proceeding before an administrative tribunal associated with the Patent Office of the home country of the applicant, including Appeals, Oppositions, Interferences, and other ex-parte and inter-parties proceedings. Includes collecting evidence, preparing and filing motions, briefs, responses, replies, surreplies, and other documents, attending conferences, depositions, hearings, and other proceedings.', '', '25', 'PA440', 4, 1, 17498),
(19254, 45, 3956, 'Validation Patent Application Preparation - International', '', 'The preparation and filing of applications for validation of an issued regional patent outside of the (&rsquo;domestic&rsquo;) home country of the applicant.', '', '35', 'PA560', 6, 1, 17510),
(19255, 45, 3956, 'Continuing Application Preparation - International', '', 'Completing a continuing patent application (claiming priority to an earlier-filed application in the same country, but without adding new disclosure) that are to be filed outside the (&rsquo;domestic&rsquo;) home country or region of the applicant, including translations, review of any invention disclosure materials or parent applications, drafting of application including pre-filing revision of any parent applications, preparation and execution of formal documents (such as assignments, declarations, information disclosure statements, transmittals, and biological deposits) filing of application, and reporting to the client.', '', '30', 'PA550', 5, 1, 17509),
(19256, 45, 3956, 'Other Patent Application Preparation - International', '', 'Preparation activities in connection with patent applications that are to be filed outside the (&rsquo;domestic&rsquo;) home country or region of the applicant, and that cannot be included under another category.', '', '40', 'PA599', 7, 1, 17507),
(19257, 45, 3956, 'Plant Patent Preparation - International', '', 'Completing plant patent applications that are to be filed outside the (&rsquo;domestic&rsquo;) home country or region of the applicant, including translations, review of any invention disclosure materials or parent applications, drafting of application including pre-filing revision of parent applications, preparation and execution of formal documents (such as assignments, declarations, information disclosure statements, transmittals, and biological deposits) filing of application, and reporting to the client.', '', '25', 'PA540', 4, 1, 17508),
(19259, 45, 3956, 'Design Application Preparation- International', 'Design Application Preparation - International', 'Completing a design patent (but not utility or utility model) applications or design registration applications that are to be filed outside the (&rsquo;domestic&rsquo;) home country or region of the applicant, including translations, review of any invention disclosure materials or parent applications, drafting of application including pre-filing revision of parent applications, preparation and execution of formal documents (such as assignments, declarations, information disclosure statements, and transmittals) filing of application, and reporting to the client.', 'Completing a design patent (but not utility or utility model) applications or design registration applications that are to be filed outside the (&rsquo;domestic&rsquo;) home country or region of the applicant, including translations, review of any invention disclosure materials or parent applications, drafting of application including pre-filing revision of parent applications, preparation and execution of formal documents (such as assignments, declarations, information disclosure statements, and transmittals) filing of application, and reporting to the client.', '20', 'PA530', 3, 1, 17506),
(19304, 45, 3966, 'Quasi-Judicial Administrative Proceedings - Domain Names', '', 'Completing a quasi-judicial proceeding before an administrative tribunal associated with domain name enforcement actions, including Uniform Domain Name Dispute Resolution (UDRP) actions administered under ICANN and WIPO.', '', '40', 'TR770', 7, 1, 17560),
(19258, 45, 3956, 'Provisional Application Preparation - International', '', 'Completing a provisional patent application that is to be filed outside the (&rsquo;domestic&rsquo;) home country or region of the applicant, including translations, review of invention disclosure materials and prior art, interviews with the inventors, drafting and revision of application, preparation and execution of formal documentation (such as assignments, transmittals, and biological deposits), filing of application, and reporting to the client.', '', '10', 'PA510', 1, 1, 17505),
(19262, 45, 3957, 'Post-Issuance Remedial Action - International', '', 'Completing a continuing patent application (claiming priority to an earlier-filed, parent application in the same country, without adding any new disclosure) that are to be filed outside of the (\"domestic\") home country or region of the applicant, including review of parent application, drafting and execution of any formal documents (such as transmittals and information disclosure statements), filing of application, and reporting to the client.', '', '30', 'PA650', 5, 1, 17515),
(19263, 45, 3957, 'Quasi-Judicial Administrative Proceedings - International', '', 'Completing a quasi-judicial proceeding before an administrative tribunal associated with a Patent Office outside of the home country of the applicant, including Appeals, Oppositions, Interferences and other ex-parte and inter-partes proceedings. Includes collecting evidence, preparing and filing motions, briefs, responses, replies, surreplies, and other documents, attending conferences, depositions, hearings, and other proceedings.', '', '25', 'PA640', 4, 1, 17514),
(19261, 45, 3957, 'Other Patent Prosecution - International', '', 'Patent prosecution activities in connection with applications that are (\"International\") filed outside the home country or region of the applicant, and that cannot be included under another category.', '', '35', 'PA699', 6, 1, 17516),
(19260, 45, 3956, 'Non-Provisional Application Preparation - International', '', 'Completing a non-provisional, utility or utility model (but not design or provisional) patent application that is to be filed outside the (&rsquo;domestic&rsquo;) home country or region of the applicant, including translations, review of any invention disclosure materials or parent applications, drafting of application (including pre-filing revision of parent applications), preparation and execution of formal documents (such as assignments, declarations, information disclosure statements, transmittals, and biological deposits) filing of application, and reporting to the client.', '', '15', 'PA520', 2, 1, 17504),
(19264, 45, 3957, 'Information Disclosure Statement - International', '', 'Bringing prior art, or other information, to the attention of an Examiner outside the home country of the applicant.', '', '10', 'PA610', 1, 1, 17511),
(19265, 45, 3957, 'Preliminary Amendment - International', '', 'Revising an application prior to the examination of the application on its merits outside the home country of the applicant, including preparation of amendments and revised drawings that do not affect the scope of the disclosure.', '', '15', 'PA620', 2, 1, 17512),
(19266, 45, 3957, 'Official Communication - International', '', 'Processing an Official Communication from a Patent Office outside the home country of the applicant, including initial review and calendaring of any response deadline, report to client with any proposed response, review of applicant&rsquo;s instructions and inventor&rsquo;s comments, preparation of amendments and/or responsive arguments, examiner interviews, and report of actions to the client. Includes activities associated with Official Communications not affecting the merits of the application, such as filing receipts, restriction/election requirements, and annuity/maintenance fee payments.', '', '20', 'PA630', 3, 1, 17513),
(19301, 45, 3965, 'Preliminary Amendment - International', '', 'Revising an application prior to the examination of the application on its merits in the home country of the applicant, including preparation of amendments and revised drawings that does not materially alter the original drawing.', '', '15', 'TR620', 2, 1, 17550),
(19302, 45, 3965, 'Official Communication - International', '', 'Processing an Official Communication from a Trademark Office outside the home country of the applicant, including initial review and calendaring of any response deadline, reporting to client with any proposed response, reviewing applicant&rsquo;s instructions and comments, preparation of amendments and/or responsive arguments, submitting response to local counsel, and reporting to the client.', '', '20', 'TR630', 3, 1, 17551),
(19303, 45, 3965, 'Affidavits, Petitions, Extensions, Declarations and Other Filings - International', '', 'Processing affidavits, petitions, extensions, declarations, and change of correspondence with the Trademark Office in the home country, including initial review and any calendaring (\"docketing\" in the U.S.) of any response deadline, reporting to client with any proposed response, reviewing applicant&rsquo;s instructions and comments, preparation of affidavits, petitions, extensions, declarations, change of address or change of ownership and/or responsive arguments, examiner interviews, and reporting to the client.', '', '10', 'TR610', 1, 1, 17549),
(19305, 45, 3966, 'Other Trademark Prosecution', '', 'Trademark related tasks that cannot be included under a previous code.', '', '45', 'TR799', 8, 1, 17561),
(19267, 45, 3958, 'Licensing', '', 'Negotiating and preparing license.', '', '25', 'PA740', 4, 1, 17520),
(19268, 45, 3958, 'Assignments and Security Interests', '', 'Negotiating and preparing assignment (i.e. previously registered or filed application) or security interest, including review of file history, checking status and meeting with client.', '', '20', 'PA730', 3, 1, 17519),
(19269, 45, 3958, 'Opinion Preparation', '', 'Completing formal legal opinions on the validity, enforceability, infringement, and/or non-infringement of a patent claim. Includes opinions on infringement of a client&rsquo;s patent by a non-client infringer.', '', '10', 'PA710', 1, 1, 17517),
(19270, 45, 3958, 'Portfolio Analysis and Management', '', 'Reviewing, analyzing, documenting, and managing a portfolio of patents. Includes patent \"due diligence\" during transactional analysis.', '', '15', 'PA720', 2, 1, 17518),
(19271, 45, 3959, 'Other Trademark Related Tasks', '', 'Opinion preparation, portfolio analysis and management, assignments and security interests, licensing, domain names, and quasi-judicial administrative proceedings for domain names.', '', '40', 'TR700', 7, 1, 17527),
(19272, 45, 3959, 'Domestic Trademark Application Preparation', '', 'Application preparation and filing for domestic trademarks.', '', '20', 'TR300', 3, 1, 17523),
(19273, 45, 3959, 'Domestic Trademark Prosecution and Renewal', '', 'Affidavits, petitions, extensions, declarations and other filings, preliminary amendments, official communications, and quasi-judicial administrative proceedings for domestic trademarks.', '', '25', 'TR400', 4, 1, 17524),
(19274, 45, 3959, 'International Trademark Application Preparation and Renewals', '', 'An application preparation and filing for international trademarks.', '', '30', 'TR500', 5, 1, 17525),
(19275, 45, 3959, 'International Trademark Prosecution and Renewal', '', 'Affidavits, petitions, extensions, declarations and other filings, preliminary amendments, official communications, and quasi-judicial administrative proceedings for international trademarks.', '', '35', 'TR600', 6, 1, 17526);
INSERT INTO `tblQuestion` (`question_id`, `survey_id`, `page_id`, `question_desc`, `question_desc_alt`, `question_extra`, `question_extra_alt`, `question_code`, `question_UTBMS`, `question_seq`, `question_enabled`, `question_id_original`) VALUES
(19276, 45, 3959, 'Trademark Investigation and Analysis', '', 'The investigation to verify ability to register, clearance and opposition investigations, publication watches, enforcement investigation, and status investigation.', '', '15', 'TR200', 2, 1, 17522),
(19277, 45, 3959, 'Assessment, Development, and Administration', '', 'Fact investigation and development, analysis and strategy, document and file management, and budgeting.', '', '10', 'TR100', 1, 1, 17521),
(19278, 45, 3960, 'Budgeting', '', 'Developing, negotiating, and revising the budget for a matter.', '', '25', 'TR140', 4, 1, 17531),
(19279, 45, 3960, 'Other Assessment, Development, or Administration', '', 'The assessment, development, administration and other activities that cannot be included under another category.', '', '30', 'TR199', 5, 1, 17532),
(19280, 45, 3960, 'Document/File Management', '', 'Creating and populating document and other databases or filing systems. Includes the planning, design, and overall management of this process.', '', '20', 'TR130', 3, 1, 17530),
(19281, 45, 3960, 'Analysis/Strategy', '', 'The thinking, strategizing, and planning for a case. Includes discussions, writing, and meetings on case strategy. Also includes initial legal research for case assessment purposes and legal research for developing a basic case strategy.', '', '15', 'TR120', 2, 1, 17529),
(19282, 45, 3960, 'Fact Investigation and Development', '', 'Investigating and understanding the facts of a matter. It includes initial meeting to discuss new matter, interviewing client personnel and potential witnesses, reviewing documents to learn the facts of a potential case, working with an investigator, and all related communications and correspondence.', '', '10', 'TR110', 1, 1, 17528),
(19283, 45, 3961, 'Status Investigation', '', 'Determining the status of a pending or registered trademark, including inquiries with the trademark office, directing outside counsel and database review, and forwarding status report to client.', '', '35', 'TR270', 6, 1, 17538),
(19284, 45, 3961, 'Other Trademark Investigation and Analysis', '', 'Trademark investigation and analysis activities that cannot be included under another category.', '', '40', 'TR299', 7, 1, 17539),
(19285, 45, 3961, 'Publication Watches', '', 'Planning, completing, and reporting the results of periodic searches for conflicting trademarks.', '', '25', 'TR250', 4, 1, 17536),
(19286, 45, 3961, 'Enforcement Investigation', '', 'Investigating a claim or potential claim of trademark infringement, dilution or unfair competition before a court of jurisdiction, including definition of the scope of the investigation, searching, analyzing the search results, and reporting to the client.', '', '30', 'TR260', 5, 1, 17537),
(19287, 45, 3961, 'Opposition Investigation', '', 'Investigating a claim or potential claim of trademark opposition, trademark infringement or trademark dilution before a trademark office tribunal, including definition of the scope of the investigation, searching, analyzing the search results, and reporting to the client.', '', '20', 'TR240', 3, 1, 17535),
(19288, 45, 3961, 'Clearance Investigation', '', 'Determining the final availability and registerability of a particular trademark, including definition of the scope of protection, searching, analyzing the search results, and reporting the results to the client. Also known as a \"full\" search.', '', '15', 'TR230', 2, 1, 17534),
(19289, 45, 3961, 'Registerability Investigation', '', 'Determining the initial availability and registerability of a particular trademark, including the definition of the scope of protection, searching, analyzing the search results, and reporting results to the client. Also known as a \"knock out\" search, or &rsquo;preliminary&rsquo; search.', '', '10', 'TR220', 1, 1, 17533),
(19290, 45, 3962, 'Other Domestic Trademark Application Preparation and Filing', '', 'Trademark application preparation activities that cannot be included under another category.', '', '15', 'TR399', 2, 1, 17541),
(19291, 45, 3962, 'Application Preparation and Filing - Domestic', '', 'Completing a trademark or service mark application (including renewal applications) that is to be filed in the (\"domestic\") home country or region of the applicant, including obtaining the specimen of use from the client, scanning the specimen for electronic filing, discussion with the client to ascertain the dates of first use and first use in commerce, drafting and revision of the application, preparation and filing of the application by electronic or paper formats, and reporting results to the client.', '', '10', 'TR310', 1, 1, 17540),
(19292, 45, 3963, 'Other Trademark Prosecution - Domestic', '', 'Trademark prosecution activities for applications that are to be initially filed in the (\"domestic\") home country or region of the applicant, and that cannot be included under any other category.', '', '30', 'TR499', 5, 1, 17546),
(19293, 45, 3963, 'Quasi-Judicial Administrative Proceedings - Domestic', '', 'Completing a quasi-judicial proceeding before an administrative tribunal associated with the Trademark Office of the home country of the applicant, including Appeals, Oppositions, and other ex-parte and inter-parties proceedings. Includes collecting evidence, preparing and filing motions, briefs, responses, replies, surreplies, and other documents, attending conferences, depositions, hearings, and other proceedings.', '', '25', 'TR440', 4, 1, 17545),
(19294, 45, 3963, 'Preliminary Amendment - Domestic', '', 'Revising an application prior to the examination of the application on its merits in the home country of the applicant, including preparation of amendments and revised drawings that does not materially alter the original drawing.', '', '15', 'TR420', 2, 1, 17543),
(19295, 45, 3963, 'Official Communication - Domestic', '', 'Processing an Official Communication from a Trademark Office (known as an \"Office Action\" in the U.S. when directed toward the merits of the application) in the home country of an application, including initial review and any calendaring (\"docketing\" in the U.S.) of any response deadline, reporting to client with any proposed response, reviewing applicant&rsquo;s instructions and comments, preparation of amendments and/or responsive arguments, examiner interviews, and reporting to the client.', '', '20', 'TR430', 3, 1, 17544),
(19296, 45, 3963, 'Affidavits, Petitions, Extensions, Declarations and Other Filings - Domestic', '', 'Processing affidavits, petitions, extensions, declarations, and change of correspondence with the Trademark Office in the home country of an application, including initial review and any calendaring (\"docketing\" in the U.S.) of any response deadline, reporting to client with any proposed response, reviewing applicant&rsquo;s instructions and comments, preparation of affidavits, petitions, extensions, declarations, change of address or change of ownership and/or responsive arguments, examiner interviews, and reporting to the client.', '', '10', 'TR410', 1, 1, 17542),
(19297, 45, 3964, 'Other International Trademark Application Preparation and Filing', '', 'International trademark application preparation activities that cannot be included in another category.', '', '15', 'TR599', 2, 1, 17548),
(19298, 45, 3964, 'Application Preparation and Filing - International', '', 'Completing a trademark, service mark or design mark application (including renewal applications) that is to be filed in a jurisdiction outside the home country or region of the applicant, including obtaining the power of attorney, translations if necessary, obtaining supporting information and documentation from the client, discussing priority filings with the client, drafting and revision of the application, preparation and filing of the application, and reporting to the client.', '', '10', 'TR510', 1, 1, 17547),
(19299, 45, 3965, 'Other Trademark Related Tasks', '', 'Trademark prosecution activities in connection with applications that are (\"International\") filed outside the home country or region of the applicant, and that cannot be included under another category.', '', '30', 'TR699', 5, 1, 17553),
(19300, 45, 3965, 'Quasi-Judicial Administrative Proceedings - International', '', 'Completing a quasi-judicial proceeding before an administrative tribunal associated with a Trademark Office outside of the home country of the applicant, including Appeals, Oppositions, and other ex-parte and inter-parties proceedings. Includes collecting evidence, preparing and filing motions, briefs, responses, replies, surreplies, and other documents, attending conferences, depositions, hearings, and other proceedings.', '', '25', 'TR640', 4, 1, 17552),
(19149, 45, 3941, 'Counseling', 'Counseling Support', 'General advice and counseling related to legal matters not specified within another category in this Substantive Area (e.g., tax, labor, corporate, regulatory).', 'Activities that support the delivery of general advice and counseling related to legal matters not specified within another category in this Substantive Area (e.g., tax, labor, corporate, regulatory).', 'CN', '', 7, 1, 17377),
(19145, 45, 3940, 'Support Activities', '', '', '', '', '', 2, 1, 17370),
(19146, 45, 3940, 'Legal Services', 'Practice Support', '', 'Processes associated with professional assistance provided to lawyers directly related to the delivery of legal services, advice and counsel.', '', '', 1, 1, 17371),
(19147, 45, 3941, 'Litigation', 'Litigation Support', 'All contested matters including judicial litigation, binding arbitration and regulatory/administrative proceedings. This category excludes Workersâ€™ Compensation cases as there is a specific section for those activities.', 'The professional assistance provided to lawyers in the litigation process. Those involved in litigation support (such as computer forensics) perform investigative data collection, preservation, discovery, analysis and verification. This category applies to all contested matters including judicial litigation, binding arbitration and regulatory/administrative proceedings. This category excludes Workersâ€™ Compensation cases as there is a specific section for those activities.', 'LT', '', 1, 1, 17379),
(19148, 45, 3941, 'Lobbying (Government Relations)', 'Lobbying (Government Relations) Support', 'Lobbying activities, legislative research, attending hearings and other public meetings, educating officials and officers, and public relations activities.', 'Support of lobbying activities, legislative research, attending hearings and other public meetings, educating officials and officers, and public relations activities.', 'LB', '', 8, 0, 17378),
(19150, 45, 3941, 'Bankruptcy', 'Bankruptcy Support', 'The reduction or elimination of certain debts by restructuring, liquidation and other proceedings.', 'The support of case administration, business operations, claims administration, plan disclosure and supporting the delivery of advice related to bankruptcy, restructuring, liquidation or related proceedings.', 'BK', '', 6, 1, 17376);
