INSERT INTO `tblSettings` (`survey_id`, `show_splash_page`, `splash_page`, `begin_page`, `end_page`, `show_summary`, `footer`, `contact_email`, `contact_phone`, `weekly_hours_text`, `annual_legal_hours_text`, `logo_splash`, `logo_survey`, `show_progress_bar`) VALUES
(45, 1, 'Welcome to the Milbank Workplace Survey. This unique survey is specifically designed to capture information that will allow us to better correlate how we work, with the design of our office space.', '<div class=\"row\">\r\n<div class=\"pageExtra\"><p class=\"sm\"><strong>Before continuing...</strong><br />\r\nThis survey form is intended for <strong>[RESPONDENT NAME]</strong>.  If you are not this person, please do not continue.  Contact your department leader or WPS Support at <a href=\"mailto:wps-support@milbank.com\">wps-support@milbank.com</a></p> \r\n</div><br />\r\n    <div class=\"col-sm-2\">\r\n    	<p class=\"h4Header\"><span class=\"glyphicon glyphicon-chevron-right blue\"></span> Overview</p>\r\n    </div>\r\n    <div class=\"col-sm-10\">\r\n    	<p class=\"sm\">This survey is intended to capture information on the activities of each person in your firm irrespective of their position or assigned department. Although you should be as precise as possible with your responses, the categories of activities are generalized allowing your responses to be \"thoughtful estimates\". It should not be necessary to refer to other records of your time or develop supplemental calculations of how your time is allocated to complete your responses.</p>\r\n    </div>\r\n</div>\r\n\r\n<div class=\"row separator\">\r\n    <div class=\"col-sm-2\">\r\n    	<p class=\"h4Header\"><span class=\"glyphicon glyphicon-chevron-right blue\"></span> Terminology</p>\r\n    </div>\r\n    <div class=\"col-sm-10\">\r\n    	<p class=\"sm\">While some of the terms used may have specific meaning to you or your firm, the descriptions provided within the survey may differ so they should be reviewed carefully.</p>\r\n    </div>\r\n</div>\r\n\r\n<div class=\"row separator\">\r\n    <div class=\"col-sm-2\">\r\n    	<p class=\"h4Header\"><span class=\"glyphicon glyphicon-chevron-right blue\"></span> Structure</p>\r\n    </div>\r\n    <div class=\"col-sm-10\">\r\n    	<p class=\"sm\">The survey is organized into two main branches of activities. The first covers Legal Services, which includes all activities associated with the preparation and delivery of legal advice to clients. The second covers Support Services, which includes all activities that support the operation of the practice. While Legal Services can generally be described as \"billable\" and Support Services as \"non-billable\" this is not a pure test and should not overly influence your responses.</p>\r\n    </div>\r\n</div>\r\n\r\n<div class=\"row separator\">\r\n    <div class=\"col-sm-2\">\r\n    	<p class=\"h4Header\"><span class=\"glyphicon glyphicon-chevron-right blue\"></span> Format</p>\r\n    </div>\r\n    <div class=\"col-sm-10\">\r\n    	<p class=\"sm\">The survey will begin by asking you to estimate the typical annual hours you spend performing Legal and Support activities. You will then be guided through a tiered structure of questions where you will be asked to allocate your time by assigning percentages to the activities within each category of activities. Because the survey is progressive, the previous level determines how much time you devote to each subsequent category. Accordingly, at each level of the survey, you are asked to allocate 100% of the time you spend within that category only.</p>\r\n    </div>\r\n</div>\r\n\r\n<div class=\"row separator\">\r\n    <div class=\"col-sm-2\">\r\n    	<p class=\"h4Header\"><span class=\"glyphicon glyphicon-chevron-right blue\"></span> Period</p>\r\n    </div>\r\n    <div class=\"col-sm-10\">\r\n    	<p class=\"sm\">When completing the survey, reflect the activities you perform in a typical year (calendar year or last 12-month period). To the extent that period contains activities that will likely never be repeated, they should be omitted. If your role has recently changed, you should reflect a typical year assuming your new responsibilities.</p>\r\n    </div>\r\n</div>\r\n\r\n<div class=\"row separator\">\r\n    <div class=\"col-sm-2\">\r\n    	<p class=\"h4Header\"><span class=\"glyphicon glyphicon-chevron-right blue\"></span> Assistance</p>\r\n    </div>\r\n    <div class=\"col-sm-10\">\r\n    	<p class=\"sm\">Please refer to the <a href=\"/accounts/1/guide.pdf\">Participant Guide</a> when completing the survey. If you have questions or experience difficulty with the survey, please contact WPS Support at <a href=\"mailto:wps-support@milbank.com\">wps-support@milbank.com</a></p>\r\n    </div>\r\n</div>', '<p class=\"surveyQuestion\">You have completed the survey. Thank you for your time!</p>\r\n     <div class=\"col-sm-10\">\r\n    	<p class=\"sm\">Your response will be aggregated with others and correlated with focus group feedback to help us better understand how we work across all our practice and administrative areas.  This improved understanding is essential to designing space that addresses not only our current challenges but those we may face in the future.</p></div><br /><br /><br /><br />\r\n<p class=\"surveyQuestion\">You may close your browser window.</p>', 0, '<p class=\"sm\">For survey instructions please refer to the <a href=\"/accounts/1/guide.pdf\">Participant Guide</a><br />\r\nWPS Support: <a href=\"mailto:wps-support@milbank.com\">wps-support@milbank.com</a><br />\r\nConfidential and Proprietary â€“ Not to be reproduced or distributed without permission.</p>', 'wps-support@milbank.com', '', 'On average, how many hours <span class=\"underline strong\">per week</span> do you work? For this purpose include ALL time including practicing, meeting, planning, organizing, etc.', 'Enter the average hours <span class=\"underline strong\">per year</span> you devote to delivering legal services.  This would typically be your billable hours plus any non-chargeable practice hours (pro bono, etc.).  It would exclude time devoted to administrative activities (time-keeping, billing, collections, business development, education, management, etc.).<br />\r\nPlease enter zero if none.', '/accounts/1/milbank-inv.png', '/accounts/1/milbank.png', 1);
